INSERT INTO `GetNews` (`id`, `Organization`, `Name`, `Description`, `Date`, `Status`) VALUES
	(50, 'Тинькофф', 'Тинькофф Банк вносит изменения в правила применения тарифов кредитных карт', 'Тинькофф Банк вносит изменения в правила применения тарифов кредитных картМосква, Россия — 9 апреля 2019 г.	Тинькофф Банк сообщает об изменениях в правилах применения тарифов кредитных карт и в некоторых тарифных планах, которые вступают в силу с сегодняшнего дня.Среди ключевых изменений:	скорректированы условия оплаты годового обслуживания кредитных карт Тинькофф. Если на дату взимания платы за годовое обслуживание у клиента отсутствует задолженность по кредитной карте, то комиссия за обслуживание взимается в размере доступного к списанию остатка собственных средств клиента, а в случае отсутствия такого остатка — при первом поступлении денежных средств на счет кредитной карты или при образовании задолженности в следующем расчетном периоде. На тарифные планы премиальных кредитных карт Тинькофф данные условия не распространяются.О Тинькофф БанкеТинькофф Банк — первый и единственный в России полностью    онлайн-банк, обслуживающий около 8,5 миллиона клиентов.У банка нет отделений: все клиенты обслуживаются дистанционно через    онлайн-каналы и     контакт-центр. В облачном    кол-центре банка работает более 10 000 сотрудников, что делает его одним из самых крупных в Европе. Собственная сеть представителей из 2 500 человек по всей России позволяет доставлять продукты уже на следующий    день после заявки.Банк развивает экосистему Tinkoff.ru, которая предоставляет финансовые и     лайфстайл-услуги. Помимо классических банковских продуктов в нее входят инвестиции, путешествия, обслуживание бизнеса, ипотека, страхование, мобильный оператор, развлечения и образование.Банк основан в 2006 году предпринимателем Олегом Тиньковым. Материнская компания банка TCS Group Holding PLC торгуется на Лондонской фондовой бирже с октября 2013 г. Чистая прибыль по МСФО по итогам 2018 г. составила    27,1 млрд руб., рентабельность капитала составила 74,7%.Тинькофф Банк — второй по объему портфеля игрок на российском рынке кредитных карт с долей рынка 11,8%.Тинькофф Банк был признан лучшим розничным    онлайн-банком мира в 2018 году и лучшим розничным    онлайн-банком России в 2018 и 2016 годах по версии Global Finance и Банком года в России в 2017 и 2013 по версии The Banker. Мобильное приложение регулярно становится победителем отраслевых рейтингов    и премий (Deloitte 2013, 2014, 2015, 2016, Global Finance 2018).', '2019-04-09', 'false'),
	(51, 'Тинькофф', 'Тинькофф Бизнес выпустил книгу-руководство для начинающих предпринимателей «Бизнес без МВА»', 'Тинькофф Бизнес выпустил книгу-руководство для начинающих предпринимателей «Бизнес без МВА»Москва, Россия — 08 апреля 2019 г.Экосистема для предпринимателей Тинькофф Бизнес и издательство «Эксмо» выпустили книгу «Бизнес без МВА». Книга написана командой Тинькофф Бизнеса под руководством главного редактора Тинькофф-журнала Максима Ильяхова. «Бизнес без МВА» можно купить в книжных магазинах по всей России или на сайте издательства.Задача книги — закрыть разрыв между сухой теорией и голым вдохновением российской бизнес-литературы. В «Бизнесе без МВА» собраны базовые советы по ведению финансов, переговоров, построении клиентского сервиса, отношениях с бизнес-партнерами и банками.Книга будет полезна всем начинающим предпринимателям или тем, кто только задумывается о том, чтобы начать свой бизнес.«Бизнес без МВА» — это еще один шаг в сторону создания образовательного контента для предпринимателей. В Тинькофф-журнале регулярно выходят статьи с разбором бухгалтерских и правовых аспектов бизнеса, публикуются истории провалов и успешные случаи запуска бизнеса в России с комментариями экспертов банка.C осени 2018 года Тинькофф Бизнес выпускает онлайн-курсы по ведению финансовой отчетности в Excel и составлению продающих текстов для бизнеса.Подробное описание книги можно прочесть на сайте mba.tb.ru. Презентация книги от Максима Ильяхова и Аси Челован доступна на YouTube.О Тинькофф БизнесеТинькофф Бизнес — сервис Тинькофф Банка по обслуживанию юридических лиц. Сервис запущен в 2015 году и вышел на прибыльность в июне 2017 года. Тинькофф Бизнес предоставляет полный спектр услуг для расчетно-кассового обслуживания малого и среднего бизнеса.Клиенты Тинькофф Бизнеса получают персонального менеджера, доступ к круглосуточному обслуживанию, бесплатные зарплатные карты для сотрудников, до 8% годовых на остаток по счету.В настоящее время продуктовая линейка Тинькофф Бизнеса включает расчетно-кассовое обслуживание рублевых и валютных счетов, бухгалтерию, конструктор сайтов и документов, зарплатный проект, торговый эквайринг, интернет-эквайринг, POS-кредитование, банковские гарантии для участников госзакупок, CRM-систему для управления продажами.', '2019-04-08', 'false'),
	(49, 'Тинькофф', 'Тинькофф Банк проведет в Санкт-Петербурге распродажу с кэшбэком до 30%', 'Тинькофф Банк проведет в Санкт-Петербурге распродажу с кэшбэком до 30%Москва, Россия — 11 апреля 2019 г.Тинькофф совместно с ТРЦ «Галерея» проведет в Санкт-Петербурге с 12 по 14 апреля распродажу Тинькофф х Галерея Sale по адресу Лиговский пр., 30A.Держатели карт Тинькофф получат до 30% кэшбэка за любые покупки в магазинах-партнерах акции в ТРЦ «Галерея» без ограничений по категориям товаров. Размер кэшбэка Тинькофф суммируется со скидками и специальными предложениями брендов. Среди участников распродажи Тинькофф х Галерея Sale — Rendez-Vous, Рив Гош, Trussardi Jeans, Gant, Victoria’s Secret, Московский ювелирный завод, Incanto и др. (полный список магазинов доступен на сайте).Дополнительные 5% кэшбэка (до 3 000 баллов) будут начислены новым клиентам Тинькофф, которые оформят карту на сайте и расплатятся ею в магазинах-участниках акции в дни проведения распродажи.Клиенты Тинькофф смогут не только получить кэшбэк за покупки, но и принять участие в развлекательной программе с выступлением известных артистов (Ханна, Миша Марвин, Леша Свик), с конкурсами и подарками от Тинькофф Банка.На протяжении всех трех дней распродажи в ТРЦ «Галерея» будет работать бьюти-зона, где держатели карт Тинькофф смогут бесплатно сделать укладку и макияж, а также стрижку и прическу в барбер-шопе. Для этого им нужно потратить в магазинах-партнерах от 7 тысяч рублей (в одном чеке), после чего они получат SMS с ссылкой на запись к мастерам бьюти-зоны (можно выбрать удобные дату и время).Каждый посетитель ТРЦ «Галерея», который совершит покупку по акции на сумму от 2 500 рублей (в одном чеке) и покажет чек на промо-стойке Тинькофф, сможет принять участие в розыгрыше призов. Каждый час ведущий развлекательной программы будет объявлять победителей и вручать подарки. В воскресенье 14 апреля в 19:00 состоится розыгрыш главного приза — 300 тысяч рублей.Тинькофф х Галерея Sale в Санкт-Петербурге — уже третья распродажа Тинькофф Банка. Первая акция состоялась в октябре 2018 года в Москве. Тогда в Тинькофф х Метрополис Sale приняло участие почти 11 тысяч человек, которые совершили 20 тысяч покупок и получили 20 млн рублей кэшбэка. Посещаемость торгового центра Метрополис в дни проведения акции возросла на четверть, а оборот магазинов-партнеров в среднем увеличился в 10 раз.Вторая распродажа Тинькофф х Планета Sale прошла в феврале 2019 года в Красноярске. Около тысячи человек совершили покупки в рамках акции и заработали почти 2 млн рублей кэшбэка. Максимальная сумма кэшбэка составила 32 663 рублей. В результате акции торговый оборот в магазинах-партнерах вырос в 8 раз, а количество покупок по картам Тинькофф — в 5 раз.О Тинькофф БанкеТинькофф Банк — первый и единственный в России полностью    онлайн-банк, обслуживающий около 8,5 миллиона клиентов.У банка нет отделений: все клиенты обслуживаются дистанционно через    онлайн-каналы и     контакт-центр. В облачном    кол-центре банка работает более 10 000 сотрудников, что делает его одним из самых крупных в Европе. Собственная сеть представителей из 2 500 человек по всей России позволяет доставлять продукты уже на следующий    день после заявки.Банк развивает экосистему Tinkoff.ru, которая предоставляет финансовые и     лайфстайл-услуги. Помимо классических банковских продуктов в нее входят инвестиции, путешествия, обслуживание бизнеса, ипотека, страхование, мобильный оператор, развлечения и образование.Банк основан в 2006 году предпринимателем Олегом Тиньковым. Материнская компания банка TCS Group Holding PLC торгуется на Лондонской фондовой бирже с октября 2013 г. Чистая прибыль по МСФО по итогам 2018 г. составила    27,1 млрд руб., рентабельность капитала составила 74,7%.Тинькофф Банк — второй по объему портфеля игрок на российском рынке кредитных карт с долей рынка 11,8%.Тинькофф Банк был признан лучшим розничным    онлайн-банком мира в 2018 году и лучшим розничным    онлайн-банком России в 2018 и 2016 годах по версии Global Finance и Банком года в России в 2017 и 2013 по версии The Banker. Мобильное приложение регулярно становится победителем отраслевых рейтингов    и премий (Deloitte 2013, 2014, 2015, 2016, Global Finance 2018).', '2019-04-11', 'false'),
	(48, 'Тинькофф', 'Тинькофф Мобайл подключает онлайн-кинотеатр Okko', 'Тинькофф Мобайл подключает онлайн-кинотеатр OkkoМосква, Россия — 15 апреля 2019 г.Оператор Тинькофф Мобайл запускает новую услугу для своих абонентов — подписку на онлайн-кинотеатр Okko (пакет подписок «Оптимум»).Подписка дает пользователям доступ к коллекции из более 20 000 фильмов и сериалов в Full HD, которая еженедельно обновляется. Кроме того, абоненты, оформившие подписку, также получат дополнительный 1 Гб трафика на просмотр фильмов в Okko.Услугу можно подключить в приложении Тинькофф Мобайл в один клик. Оператор предлагает своим абонентам выгодные условия пользования подпиской: первые 30 дней пользования подпиской будут бесплатными, далее стоимость составит 399 рублей за 30 дней.Фильмы и сериалы можно смотреть с различных устройств как в онлайне (через мобильные приложения, веб-версию, приставки, SmartTV), так и в офлайне, закачав предварительно видео в мобильное приложение Okko для iOs или Android.Okko стал уже пятым партнером Тинькофф Мобайла, которого оператор интегрировал в свой сервис. Ранее абонентам стали доступны подписки на музыкальные сервисы ВООМ, «Звук», Яндекс. Музыку и видеосервис Megogo.«Мы продолжаем расширять продуктовое предложение для наших клиентов, предлагая им как свои собственные решения, так и лучшие услуги и сервисы, представленные на рынке. Теперь у наших абонентов появился доступ к одному из лучших российских онлайн-кинотеатров с любого устройства на выгодных условиях», — говорит CEO Тинькофф Мобайл Георгий Чесаков.«Сделать просмотр кино в высоком качестве доступным как можно большему количеству зрителей когда и где угодно, с любого устройства — одно из приоритетных направлений нашего развития, — подчеркивает генеральный директор онлайн-кинотеатра Okko Иван Гродецкий. — Сотрудничество с Тинькофф Мобайл — очередной шаг в этом направлении. Уверен, абоненты оценят преимущества Okko: превосходную картинку в высоком разрешении, объемный звук DolbyDigital, обширную библиотеку контента и полное отсутствие рекламы».О Тинькофф МобайлеТинькофф Мобайл — виртуальный мобильный оператор, который вместе с Тинькофф Банком входит в Группу компаний Тинькофф. Оператор запущен в декабре 2017 года.На сегодняшний день бренд Тинькофф Мобайл представлен в 53 регионах России: Москве,    Санкт-Петербурге, Архангельской, Белгородской, Брянской, Владимирской, Волгоградской, Вологодской, Воронежской, Иркутской, Калининградской, Калужской, Кемеровской, Кировской, Костромской, Курганской, Ленинградской, Липецкой, Магаданской, Московской,    Мурманской, Новгородской, Новосибирской, Омской, Оренбургской, Орловской, Пензенской, Псковской, Самарской, Саратовской, Сахалинской, Смоленской, Тамбовской, Тверской, Тульской, Томской, Тюменской областях, республиках Адыгея, Карелия, Коми, Марий    Эл, Мордовия, Татарстан, Тыва и Хакасия, Удмуртской Республике, Алтайском, Камчатском, Краснодарском, Красноярском и Пермском краях,    Ханты-Мансийском и     Ямало-Ненецком автономных округах.Тинькофф Мобайл работает по модели full MVNO на базе сети радиодоступа и инфраструктуры Tele2 — имеет собственный код сети, выделенный диапазон номеров,    сим-карты и     бизнес-приложения. Данная модель обеспечивает максимальную гибкость в разработке процессов обслуживания и тарифных планов для абонентов. Виртуальный мобильный оператор обеспечивает покрытие по всей России и полностью интегрирован    с Тинькофф Банком.Абоненты оператора могут самостоятельно составлять удобный тариф и выбирать необходимые пакеты услуг — линейка тарифов отсутствует. Также Тинькофф Мобайл предлагает такие востребованные опции, как бесплатная виртуальная карта Тинькофф Банка    для абонентов, управление счетом через мобильное приложение, выгодный международный роуминг, возможность использовать одну    сим-карту на разных устройствах, переход на больший пакет услуг в любой момент с доплатой стоимости, бесплатную доставку    сим-карт.', '2019-04-15', 'false'),
	(47, 'Тинькофф', 'Tinkoff.ru запустил сервис бронирования ресторанов', 'Tinkoff.ru запустил сервис бронирования ресторановМосква, Россия — 16 апреля 2019 г.На Tinkoff.ru появился новый раздел «Развлечения» с сервисом бронирования столиков в ресторанах Москвы, Санкт-Петербурга и других крупных городов России. В ближайшем будущем пользователи Tinkoff.ru также смогут покупать в этом разделе билеты в кино.Выбрать ресторан можно по удобным критериям — по названию, типу кухни, среднему чеку или наличию кэшбэка. Для этого можно настроить соответствующие фильтры или воспользоваться поисковой строкой. Помочь с выбором ресторана также могут специальные теги, которые автоматически формируются в зависимости от региона и от популярности запросов.Пользователи Tinkoff.ru могут найти подходящий ресторан в Москве и Санкт-Петербурге с помощью специальных тематических подборок, для которых редакторы Тинькофф отобрали более 1 000 популярных мест. Среди подборок: «Где хорошо обедать», «Красивый вид», «Рестораны с кэшбэком», «Лучшие коктейли», «Куда пойти на свидание» и др. О каждом ресторане можно узнать более подробно: посмотреть часы работы заведения, адрес, контакты, меню, фотографии интерьера и блюд.Держатели карт Тинькофф могут забронировать столик в ресторане всего в один клик — без дополнительных звонков и подтверждения брони. Проверить статус бронирования можно в разделе «Мои заказы», здесь же будет видна вся история посещений.Клиентам Тинькофф также доступны специальные предложения, например — до 20% кэшбэка за оплату счета в выбранном ресторане. В будущем список городов и ресторанов в рамках спецпредложений будет расширяться.«Экосистема Тинькофф продолжает развивать лайфстайл-сервисы и открывает пользователям новые возможности в области развлечений. Сервис бронирования столиков в ресторанах уже знаком клиентам мобильного банка Тинькофф — теперь он доступен и на Tinkoff.ru. Рестораны — это только начало большого пути. В будущем мы продолжим развивать раздел „Развлечения“ и будем предлагать клиентам еще больше интересных лайфстал-услуг на основе их персональных предпочтений, например — добавим возможность покупать билеты в кино, на спектакли и концерты через Tinkoff.ru», — комментирует Максим Евдокимов, вице-президент Тинькофф Банка по развитию мобильных и интернет-сервисов.О Тинькофф БанкеТинькофф Банк — первый и единственный в России полностью    онлайн-банк, обслуживающий около 8,5 миллиона клиентов.У банка нет отделений: все клиенты обслуживаются дистанционно через    онлайн-каналы и     контакт-центр. В облачном    кол-центре банка работает более 10 000 сотрудников, что делает его одним из самых крупных в Европе. Собственная сеть представителей из 2 500 человек по всей России позволяет доставлять продукты уже на следующий    день после заявки.Банк развивает экосистему Tinkoff.ru, которая предоставляет финансовые и     лайфстайл-услуги. Помимо классических банковских продуктов в нее входят инвестиции, путешествия, обслуживание бизнеса, ипотека, страхование, мобильный оператор, развлечения и образование.Банк основан в 2006 году предпринимателем Олегом Тиньковым. Материнская компания банка TCS Group Holding PLC торгуется на Лондонской фондовой бирже с октября 2013 г. Чистая прибыль по МСФО по итогам 2018 г. составила    27,1 млрд руб., рентабельность капитала составила 74,7%.Тинькофф Банк — второй по объему портфеля игрок на российском рынке кредитных карт с долей рынка 11,8%.Тинькофф Банк был признан лучшим розничным    онлайн-банком мира в 2018 году и лучшим розничным    онлайн-банком России в 2018 и 2016 годах по версии Global Finance и Банком года в России в 2017 и 2013 по версии The Banker. Мобильное приложение регулярно становится победителем отраслевых рейтингов    и премий (Deloitte 2013, 2014, 2015, 2016, Global Finance 2018).', '2019-04-16', 'false'),
	(46, 'Тинькофф', 'Тинькофф Инвестиции разыграют 4,2 млн рублей за пополнение брокерских счетов', 'Тинькофф Инвестиции разыграют 4,2 млн рублей за пополнение брокерских счетовМосква, Россия — 16 апреля 2019 г. Брокерский сервис Тинькофф Инвестиции объявляет о начале акции с общим призовым фондом 4,2 млн рублей. Денежные призы в размере от 30 до 300 тысяч рублей получат 60 победителей, которые выполнят одно из условий конкурса.Принять участие в акции могут как действующие владельцы брокерских счетов в Тинькофф Инвестициях (на ИИС условия конкурса не распространяются), так и новые клиенты, бесплатно оформившие брокерские счета в Тинькофф с 15 апреля до 8 июля 2019 года на Tinkoff.ru или через мобильное приложение.Для участия в конкурсе пользователю Тинькофф Инвестиций в период с 15 апреля по 8 июля 2019 года включительно нужно купить ценные бумаги на сумму 1 000 рублей и выполнить одно из условий:		пополнить свой брокерский счет на сумму 500 тысяч рублей (или эквивалентную сумму в любой другой иностранной валюте)или		оплатить картой (Tinkoff Black/ Tinkoff Black Edition) ценные бумаги/ валюту на бирже на сумму 500 тысяч рублей (или эквивалентную сумму в любой другой иностранной валюте)Розыгрыш призов будет проходить в 6 этапов. На каждом из них будет названо 10 победителей: за 1 место пользователь Тинькофф Инвестиций получит 300 тысяч рублей, за 2 место — 130 тысяч рублей, за 3 место — 60 тысяч рублей, за 4–10 места — по 30 тысяч рублей.Конкурс продлится в течение трех месяцев и завершится 9 июля — в этот день будут объявлены последние призеры.Расписание этапов конкурса	1 этап: 15—28 апреля	2 этап: 29 апреля — 12 мая	3 этап: 13–26 мая	4 этап: 27 мая — 9 июня	5 этап: 10—26 июня	6 этап: 24 июня — 8 июляКаждый участник акции может получить приз только один раз на одном из этапов конкурса.Победители будут определены с помощью генератора случайных чисел (по номеру договора на обслуживание брокерского счета, который можно проверить в личном кабинете в разделе «О счете») и опубликованы на сайте на следующий день после завершения каждого из этапов конкурса.Узнать подробнее об условиях акции можно по ссылке.О Тинькофф БанкеТинькофф Банк — первый и единственный в России полностью    онлайн-банк, обслуживающий около 8,5 миллиона клиентов.У банка нет отделений: все клиенты обслуживаются дистанционно через    онлайн-каналы и     контакт-центр. В облачном    кол-центре банка работает более 10 000 сотрудников, что делает его одним из самых крупных в Европе. Собственная сеть представителей из 2 500 человек по всей России позволяет доставлять продукты уже на следующий    день после заявки.Банк развивает экосистему Tinkoff.ru, которая предоставляет финансовые и     лайфстайл-услуги. Помимо классических банковских продуктов в нее входят инвестиции, путешествия, обслуживание бизнеса, ипотека, страхование, мобильный оператор, развлечения и образование.Банк основан в 2006 году предпринимателем Олегом Тиньковым. Материнская компания банка TCS Group Holding PLC торгуется на Лондонской фондовой бирже с октября 2013 г. Чистая прибыль по МСФО по итогам 2018 г. составила    27,1 млрд руб., рентабельность капитала составила 74,7%.Тинькофф Банк — второй по объему портфеля игрок на российском рынке кредитных карт с долей рынка 11,8%.Тинькофф Банк был признан лучшим розничным    онлайн-банком мира в 2018 году и лучшим розничным    онлайн-банком России в 2018 и 2016 годах по версии Global Finance и Банком года в России в 2017 и 2013 по версии The Banker. Мобильное приложение регулярно становится победителем отраслевых рейтингов    и премий (Deloitte 2013, 2014, 2015, 2016, Global Finance 2018).', '2019-04-16', 'false'),
	(45, 'Тинькофф', 'Тинькофф — генеральный партнер Петербургского международного экономического форума 2019 года', 'Тинькофф — генеральный партнер Петербургского международного экономического форума 2019 годаМосква, Россия — 17 апреля 2019 г.Тинькофф второй год подряд стал генеральным партнером Петербургского международного экономического форума (ПМЭФ).Петербургский международный экономический форум — уникальное событие в мире экономики и бизнеса. ПМЭФ проводится с 1997 года, а с 2006 года проходит под патронатом и при участии президента Российской Федерации. За прошедшие годы Форум стал ведущей мировой площадкой для общения представителей деловых кругов и обсуждения ключевых экономических вопросов, стоящих перед Россией, развивающимися рынками и миром в целом. Основные мероприятия ПМЭФ-2019, организатором которого выступает Фонд «Росконгресс», пройдут 6—8 июня 2019 года в Конгрессно-выставочном центре «Экспофорум».Топ-менеджеры Тинькофф Банка участвуют в работе ПМЭФ с 2016 года. В 2018 году Тинькофф впервые выступил в роли генерального партнера Форума и организовал в рамках деловой программы несколько ярких событий, в том числе сессию «Цифровое будущее в финансах — борьба экосистем» с участием председателя правления банка Оливера Хьюза и public talk основателя банка Олега Тинькова с телеведущим Владимиром Познером, ставший одним из самых посещаемых официальных мероприятий ПМЭФ-2018.В 2019 году делегация Тинькофф во главе с председателем совета директоров Олегом Тиньковым планирует принять еще более активное участие в деловой и культурной программе Форума.О Тинькофф БанкеТинькофф Банк — первый и единственный в России полностью    онлайн-банк, обслуживающий около 8,5 миллиона клиентов.У банка нет отделений: все клиенты обслуживаются дистанционно через    онлайн-каналы и     контакт-центр. В облачном    кол-центре банка работает более 10 000 сотрудников, что делает его одним из самых крупных в Европе. Собственная сеть представителей из 2 500 человек по всей России позволяет доставлять продукты уже на следующий    день после заявки.Банк развивает экосистему Tinkoff.ru, которая предоставляет финансовые и     лайфстайл-услуги. Помимо классических банковских продуктов в нее входят инвестиции, путешествия, обслуживание бизнеса, ипотека, страхование, мобильный оператор, развлечения и образование.Банк основан в 2006 году предпринимателем Олегом Тиньковым. Материнская компания банка TCS Group Holding PLC торгуется на Лондонской фондовой бирже с октября 2013 г. Чистая прибыль по МСФО по итогам 2018 г. составила    27,1 млрд руб., рентабельность капитала составила 74,7%.Тинькофф Банк — второй по объему портфеля игрок на российском рынке кредитных карт с долей рынка 11,8%.Тинькофф Банк был признан лучшим розничным    онлайн-банком мира в 2018 году и лучшим розничным    онлайн-банком России в 2018 и 2016 годах по версии Global Finance и Банком года в России в 2017 и 2013 по версии The Banker. Мобильное приложение регулярно становится победителем отраслевых рейтингов    и премий (Deloitte 2013, 2014, 2015, 2016, Global Finance 2018).', '2019-04-17', 'false'),
	(44, 'Тинькофф', 'Группа Тинькофф расширяет пул участников долгосрочной программы мотивации персонала', 'Группа Тинькофф расширяет пул участников долгосрочной программы мотивации персоналаМосква, Россия — 18 апреля 2019 г.Группа Тинькофф объявляет о расширении пула участников долгосрочной программы мотивации персонала (MLTIP — management long-term incentive program). В первом квартале 2019 г. Совет директоров Группы одобрил добавление в программу 10 новых участников.Программа долгосрочной мотивации персонала действует в Группе Тинькофф с 2011 года. В рамках программы любой сотрудник Тинькофф, демонстрирующий выдающиеся результаты работы, может стать ее участником и совладельцем Тинькофф путем получения GDR Группы. Совокупный размер вознаграждения всех участников программы составляет приблизительно 5,6% от текущего объема выпущенного акционерного капитала Группы.Долгосрочная программа мотивации персонала рассчитана на шесть лет, при этом право на получение вознаграждения напрямую зависит от выполнения годовых целей. Все участники программы являются штатными сотрудниками Группы, работающими на территории России.Среди участников программы — сотрудники самых разных специализаций: IT, финансы, юриспруденция, маркетинг, PR и другие. Около 10% участников программы начинали работу в Тинькофф на позиции оператора в колл-центре.С учетом постоянного расширения масштабов и направлений деятельности Группы программа призвана обеспечить более тесную связь между интересами руководства компании и интересами акционеров с целью увеличения стоимости Группы.Олег Тиньков, основатель Тинькофф, отметил: «В России не так много компаний, где есть подобные программы долгосрочной мотивации персонала, а для консервативной финансовой сферы наша программа является по-настоящему уникальной.В нашей программе уже около 100 человек — моих партнеров и совладельцев бизнеса — и мы планируем расширять и дальше пул участников. Я особенно горжусь тем, что бОльшая часть участников программы начинали карьеру в Тинькофф со стартовых позиций, а примерно 10% текущих участников прграммы — c позиций операторов колл-центра.Новые участники программы являются неотъемлемой частью команды, которая прилагает все усилия для того, чтобы Тинькофф был одной из самых высокотехнологичных финансовых компаний в мире. Я приглашаю своих коллег разделить наш успех и уверен, что участие в программе будет мотивировать их и дальше работать на развитие бизнеса, предлагать еще более инновационные решения и делать все для наших новых побед».О ГруппеTCS Group Holding PLC — инновационный    онлайн-провайдер розничных финансовых услуг, в состав которого входят Тинькофф Банк, виртуальный мобильный оператор Тинькофф Мобайл, Тинькофф Страхование, а также сеть центров разработки в крупнейших российских городах «Тинькофф    Центр Разработки».Группа была основана в 2006 г. предпринимателем Олегом Тиньковым и торгуется на Лондонской фондовой бирже с октября 2013 г.У Группы нет розничных отделений: компания обслуживает клиентов дистанционно через    онлайн-каналы и     контакт-центр. Для доставки продуктов Группа построила сеть представителей, которая насчитывает более 2500 человек. Сеть покрывает всю Россию и позволяет осуществлять доставку карт большинству клиентов на следующий день после принятия    решения о выдаче.Ключевой бизнес Группы — Тинькофф Банк, первый и единственный полностью    онлайн-банк в России, который предоставляет как свои собственные, так и партнерские финансовые услуги на платформе Tinkoff.ru. Продуктовая линейка включает текущее банковское обслуживание (кредитные и дебетовые карты, платежи,    переводы), вклады, инвестиции, программы лояльности, сервисы по бронированию путешествий, услуги для бизнеса, ипотечные продукты и страхование. Банк уделяет большое внимание мобильному направлению: помимо мобильного банка, компания выпускает    моноприложения, доступные и для не клиентов банка («Штрафы ГИБДД», MoneyTalk, «С карты на карту — быстрые переводы денег»).По состоянию на 1 мая 2018 г. Тинькофф Банк является вторым по объему портфеля игроком на российском рынке кредитных карт с долей рынка 11,7%. Чистая прибыль TCS Group Holding PLC по МСФО по итогам первого    квартала 2018 г. составила 5,7 млрд руб., рентабельность капитала составила 68,5%.Тинькофф Банк был признан «Банком года 2016» по версии крупнейшего российского финансового портала Banki.ru. В октябре 2016 г. Тинькофф Банк был признан самым крупным независимым    онлайн-банком в мире по количеству клиентов по результатам исследования Frost & Sullivan. В 2015 г. и в 2016 г. международный банковский журнал Global Finance признал Тинькофф Банк лучшим    онлайн-банком в России. В 2016 г. Global Finance признал сайт Tinkoff.ru лучшим универсальным интегрированным банковским сайтом. В 2016 г. международный журнал о финансах Euromoney признал Тинькофф Банк лучшим    цифровым банком в Центральной и Восточной Европе. Мобильное приложение Тинькофф Банка признано лучшим в России в 2014, 2015 и 2016 гг. агентством Markswebb Rank & Report и в     2013—2016 гг. компанией Deloitte.', '2019-04-18', 'false'),
	(43, 'Тинькофф', 'Премиальный тариф Тинькофф Инвестиций стал доступен для всех', 'Премиальный тариф Тинькофф Инвестиций стал доступен для всехМосква, Россия — 22 апреля 2019 г.Брокерский сервис Тинькофф Инвестиции открывает премиальное обслуживание для всех пользователей без ограничений. Ранее тариф «Премиум» в Тинькофф Инвестициях был доступен только по приглашениям.Оставить заявку на оформление брокерского счета с тарифом «Премиум» или перейти с текущего тарифа («Инвестор»/ «Трейдер») на премиальный можно на сайте или в мобильном приложении Тинькофф Инвестиции. Кроме того, пользователи тарифа «Премиум» теперь могут оформить на Tinkoff.ru премиальную карту Tinkoff Black Edition с бесплатным обслуживанием, а также подавать поручения на покупку/ продажу ценных бумаг в режиме 24/7.С 1 мая по 31 июля 2019 г. премиальные клиенты Тинькофф Инвестиций в рамках специальной акции смогут торговать на бирже без комиссии за операции с акциями, ETF, депозитарными расписками из расширенного каталога бумаг (кроме паев ПИФ).«После успешного тестирования премиального тарифа в формате закрытого клуба мы решили открыть доступ к премиальному обслуживанию для всех желающих. Мы ожидаем, что до конца года доля премиальных клиентов от всех пользователей брокерской платформы Тинькофф составит 5–10%. Чек-ап инвестиционного портфеля, подробные отчеты на русском языке от аналитиков по конкретным бумагам или компаниям, как и прежде, будут доступны онлайн — в мобильном приложении Тинькофф Инвестиции», — комментирует Александр Емешев, вице-президент, директор по разработке новых продуктов Тинькофф Банка.Запуск премиального тарифа в Тинькофф Инвестициях состоялся в сентябре 2018 года. Пользователи получили доступ к максимально широкому для российского рынка каталогу мировых ценных бумаг (более 10 000 позиций) и поддержку персонального менеджера прямо в мобильном приложении. С каждым пользователем Тинькофф Инвестиций Премиум работает команда персональных менеджеров и аналитиков, доступных в чате мобильного приложения в режиме 24/7. С момента запуска тарифа «Премиум» персональные менеджеры ответили на десятки тысяч обращений клиентов в чатах, в том числе — в ночное время (примерно четверть).Брокерская платформа Тинькофф Инвестиции регулярно предлагает пользователям новые решения в рамках тарифа «Премиум»: в этом году у них появилась возможность торговать на бирже с помощью веб-терминала Тинькофф, выставлять лимитные заявки на инструменты из расширенного списка ценных бумаг, бесплатно читать статьи газеты и сайта «Ведомости», которые обычно доступны только по платной подписке, совершать сделки с более низкими комиссиями, которые уже включают в себя биржевые сборы.В апреле 2019 года сервис Тинькофф Инвестиции улучшил условия по всем тарифам, в том числе — по премиальному. Так, обслуживание брокерского счета в следующем расчетном периоде, если в течение текущего периода инвестиционный портфель клиента составлял 10 млн рублей и выше, стало бесплатным. За сделки с ценными бумагами, которые входят в основной каталог сервиса Тинькофф Инвестиции, комиссия снизилась до 0,025%. За сделки с акциями, ПИФами, ETF, депозитарными расписками из расширенного списка бумаг комиссия упала до 0,25%. Чтобы получить доступ к полному каталогу ценных бумаг, клиенту нужно получить статус квалифицированного инвестора: этот вопрос полностью решается в чате мобильного приложения. Комиссия по сделкам с облигациями и еврооблигациями на сумму от $25 000 и более из расширенного списка бумаг составила 0,25%.О Тинькофф БанкеТинькофф Банк — первый и единственный в России полностью    онлайн-банк, обслуживающий около 8,5 миллиона клиентов.У банка нет отделений: все клиенты обслуживаются дистанционно через    онлайн-каналы и     контакт-центр. В облачном    кол-центре банка работает более 10 000 сотрудников, что делает его одним из самых крупных в Европе. Собственная сеть представителей из 2 500 человек по всей России позволяет доставлять продукты уже на следующий    день после заявки.Банк развивает экосистему Tinkoff.ru, которая предоставляет финансовые и     лайфстайл-услуги. Помимо классических банковских продуктов в нее входят инвестиции, путешествия, обслуживание бизнеса, ипотека, страхование, мобильный оператор, развлечения и образование.Банк основан в 2006 году предпринимателем Олегом Тиньковым. Материнская компания банка TCS Group Holding PLC торгуется на Лондонской фондовой бирже с октября 2013 г. Чистая прибыль по МСФО по итогам 2018 г. составила    27,1 млрд руб., рентабельность капитала составила 74,7%.Тинькофф Банк — второй по объему портфеля игрок на российском рынке кредитных карт с долей рынка 11,8%.Тинькофф Банк был признан лучшим розничным    онлайн-банком мира в 2018 году и лучшим розничным    онлайн-банком России в 2018 и 2016 годах по версии Global Finance и Банком года в России в 2017 и 2013 по версии The Banker. Мобильное приложение регулярно становится победителем отраслевых рейтингов    и премий (Deloitte 2013, 2014, 2015, 2016, Global Finance 2018).', '2019-04-22', 'false'),
	(42, 'Тинькофф', 'Тинькофф и Яндекс представляют совместную карту с выгодным кэшбэком', 'Тинькофф и Яндекс представляют совместную карту с выгодным кэшбэкомМосква, Россия — 23 апреля 2019 г.Тинькофф совместно с Яндексом запускает кобрендинговые карты с кэшбэком до 10% на сервисы Яндекс.Плюс.Держатели дебетовых и кредитных карт Тинькофф — Яндекс. Плюс смогут получить до 10% кэшбэка за платежи в одном из 15 сервисов Яндекс. Плюса (Музыка, Драйв, Афиша, Шеф и др.). До 31 июля 2019 года десятипроцентный кэшбэк будет действовать на услуги Яндекс. Такси. Далее кэшбэк в 10% будет устанавливаться на один из сервисов Яндекс. Плюс один раз в три месяца.Кэшбэк в 5% по картам Тинькофф — Яндекс. Плюс можно получить:    за покупки во всех других сервисах Яндекс. Плюс;    за любые траты в категориях «рестораны», «обучение», «спорт», «развлечения»;    за бронирование отелей и аренду автомобилей на трэвел-платформе Тинькофф Путешествия. Владельцам дебетовых и кредитных карт Тинькофф — Яндекс. Плюс доступен 1% кэшбэка за любые повседневные покупки. Всем держателям дебетовых и кредитных карт Тинькофф — Яндекс. Плюс также ежемесячно начисляется повышенный кэшбэк до 30% в рамках спецпредложений от партнеров Тинькофф.Среди других ключевых преимуществ новой кобрендинговой карты Тинькофф — Яндекс. Плюс:    бесплатный выпуск и годовое обслуживание для дебетовой и кредитной карт;    кредитный лимит до 700 000 рублей для кредитной карты;     6% годовых на остаток для дебетовой карты;    бесплатные переводы на карты других банков, а также по номеру телефона клиентам Сбербанка через сервисы Тинькофф — для дебетовой карты (до 20 000 рублей в расчетный период);    бесплатное пополнение счета карты в банкоматах Тинькофф (для дебетовых и кредитных карт) и у партнеров (для кредитных карт).Также клиентам доступна бесплатная доставка карты представителем Тинькофф в любое время и место, а также высокий уровень клиентской поддержки, в том числе — в чате мобильного приложения Тинькофф Банка.Для держателей карты Тинькофф — Яндекс. Плюс действует годовая подписка на сервис Яндекс. Плюс: она подключается автоматически после активации карты в личном кабинете на Tinkoff.ru. Она дает полный доступ к сервису Яндекс. Музыка, скидки (в дополнение к кэшбэкам) на Такси и Драйв, бесплатную доставку с маркетплейса Беру и другие преимущества. Владелец карты может пользоваться подпиской фактически бесплатно: если тратить по карте от 5 000 рублей в месяц, плата за подписку полностью возвращается в виде кэшбэка. Кроме того, для всех, кто оформит карту, в первый месяц подписка будет бесплатной. Она сохранится, даже если клиент перевыпустил карту или сменил программу лояльности.«Карта Яндекс. Плюс от Тинькофф — это банковская карта современного человека. Она подойдет тем, кто не представляет свою жизнь без технологий, ценит свое время и пользуется сервисами Яндекса. У карты есть все преимущества, которые дает партнерство двух крупнейших экосистем — выгодные условия, кэшбэк рублями и доступ к лайфстайл-сервисам Тинькофф», — комментирует Артём Яманов, старший вице-президент Тинькофф Банка.«С банковской картой Яндекс. Плюс пользователи смогут получить ещё больше от сервисов Яндекса. Эта карта пригодится и тем, кто регулярно ездит на Яндекс. Такси, и тем, кто иногда покупает билеты на Яндекс. Афише, и даже тем, кто вообще не пользуется нашими сервисами. Кэшбэк на любые покупки и бесплатное обслуживание делают карту Яндекс. Плюс выгодной для всех», — говорит операционный директор Яндекса Грег Абовский.О Тинькофф БанкеТинькофф Банк — первый и единственный в России полностью    онлайн-банк, обслуживающий около 8,5 миллиона клиентов.У банка нет отделений: все клиенты обслуживаются дистанционно через    онлайн-каналы и     контакт-центр. В облачном    кол-центре банка работает более 10 000 сотрудников, что делает его одним из самых крупных в Европе. Собственная сеть представителей из 2 500 человек по всей России позволяет доставлять продукты уже на следующий    день после заявки.Банк развивает экосистему Tinkoff.ru, которая предоставляет финансовые и     лайфстайл-услуги. Помимо классических банковских продуктов в нее входят инвестиции, путешествия, обслуживание бизнеса, ипотека, страхование, мобильный оператор, развлечения и образование.Банк основан в 2006 году предпринимателем Олегом Тиньковым. Материнская компания банка TCS Group Holding PLC торгуется на Лондонской фондовой бирже с октября 2013 г. Чистая прибыль по МСФО по итогам 2018 г. составила    27,1 млрд руб., рентабельность капитала составила 74,7%.Тинькофф Банк — второй по объему портфеля игрок на российском рынке кредитных карт с долей рынка 11,8%.Тинькофф Банк был признан лучшим розничным    онлайн-банком мира в 2018 году и лучшим розничным    онлайн-банком России в 2018 и 2016 годах по версии Global Finance и Банком года в России в 2017 и 2013 по версии The Banker. Мобильное приложение регулярно становится победителем отраслевых рейтингов    и премий (Deloitte 2013, 2014, 2015, 2016, Global Finance 2018).', '2019-04-23', 'false'),
	(11, 'Альфа-Банк', 'Альфа-Банк, Яндекс и MasterCard представили карту Яндекс.Плюс с кешбэком до 10%', 'Альфа-Банк вместе с Яндекс и MasterCard предложили пользователям карту Яндекс.Плюс. С такой картой пользоваться сервисами Яндекса выгоднее: она дает кешбэк до 10% на Такси, Еду, Драйв, Афишу и не только — всего в списке 15 сервисов. Кроме того, ее обладатель получает кешбэк до 5% в категории рестораны, развлечения, спорт, образование и 1% на остальные покупки. Выпуск и обслуживание дебетовой карты бесплатны.\n\n\n«Мы рады предложить удобную и выгодную карту, с помощью которой клиенты банка могут воспользоваться кешбэком и скидками на все продукты и услуги Яндекса. Для нас очень важен запуск совместного продукта, так как он дает доступ клиентам к лучшим сервисам — как банковским, с нашей стороны, так и нефинансовым со стороны нашего партнера», — говорит руководитель розничного бизнеса, член правления Альфа-Банка Майкл Тач.\n\n\nЯндекс.Плюс — это карта World Mastercard, кредитная или дебетовая. Она подходит для повседневных покупок, онлайн-платежей и переводов, на нее можно получать зарплату, с ней удобно путешествовать. Главное преимущество карты — кешбэк на все:\n\n10% на поездки с Яндекс.Такси и 5% в остальных сервисах, включая маркетплейс Беру, Еду, Драйв, Афишу и Путешествия. Сервисы с десятипроцентным кешбэком будут сменять друг друга каждые три месяца. Так, в Такси он будет действовать до конца июля, а начиная с августа кешбэк 10% можно будет получить за оплату покупок в другом сервисе\n5% на покупки сразу в четырёх категориях: рестораны, развлечения, спортивные товары и образовательные услуги\n1% на все остальные покупки\n\n\nКешбэк начисляется ежемесячно в российских рублях.\n\n\nЕще выгоднее карта будет вместе с подпиской на Яндекс.Плюс: пользователи получают скидки на Такси и Драйв в дополнение к кэшбэку, полный доступ к Яндекс.Музыке, бесплатную доставку покупок в маркетплейсе Беру и другие преимущества. Если тратить по карте от 5000 рублей в месяц, плата за подписку полностью возвращается в виде кешбэка.\n\n\n«С банковской картой Яндекс.Плюс пользователи смогут получить ещё больше от сервисов Яндекса. Эта карта пригодится и тем, кто регулярно ездит на Яндекс.Такси, и тем, кто иногда покупает билеты на Яндекс.Афише, и даже тем, кто вообще не пользуется нашими сервисами. Кэшбэк на любые покупки и бесплатное обслуживание делают карту Яндекс.Плюс выгодной для всех», — говорит операционный директор Яндекса Грег Абовский.\n\n\nКлиенты банка могут заказать и выпустить карту всего за минуту в мобильном приложении Альфа-Мобайл. Карту можно сразу добавить в Apple Pay и оплачивать покупки с помощью смартфона везде, где установлены терминалы бесконтактной оплаты, в приложениях и в интернете. При необходимости клиент всегда сможет получить физически карту в ближайшем отделении Альфа-Банка, который он указал при заказе карты, или с помощью курьера — в удобное для него время. \n\n\nКроме того, заказать карту можно на сайте Альфа-Банка https://alfabank.ru/yandexcard/ Яндекса https://plus.yandex.ru/card и получить в любом отделении Альфа-Банка, или ее доставит курьер.\n\n\n«Россия — одна из стран, где внедрены самые передовые мировые инновации в платежных технологиях, и где жители активно пользуются картами. Россияне любят безналичную оплату за быстроту и удобство и ценят привилегии и финансовые возможности, которые связаны именно с банковскими картами — кешбэк, бонусы, специальные предложения. В недавнем опросе ВЦИОМ 8 из 10 человек отметили, что именно наличие кешбэка является для них главным фактором при выборе карты, — сказал Алексей Малиновский, глава Mastercard в России. — Карты, которые мы представили сегодня, не только предлагают выгодные условия, но и объединяют уникальные преимущества каждого из партнеров проекта».\n\n\nОбслуживание кредитной карты — первый год бесплатно, со второго года стоимость обслуживания составит 490 рублей.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-23', 'false'),
	(12, 'Альфа-Банк', 'АЛЬФА-БАНК сообщает о выплате купонного дохода', 'Доводим до Вашего сведения, что сегодня Альфа-Банк выполнил обязательства по выплате процентного дохода по первому купону биржевых облигаций серии 001Р-02 в объеме 1 201,20 долларов США.\nПараметры выпуска серии 001Р-02 — ISIN: RU000A0ZZ4B9, идентификационный номер 4B020201326B001P от 16.04.2018, объем эмиссии — 12,012 млн долларов США, дата размещения — 20.04.2018, дата погашения — 20.10.2021. Дата начала первого купонного периода — 20.04.2018, дата окончания — 20.04.2019, текущая ставка купона — 0,01%, периодичность выплаты купона — 1 раз в год. \nКупонный доход выплачен в срок и в полном объеме.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-22', 'false'),
	(13, 'Альфа-Банк', 'Альфа-Банк занимает 65% рынка импортного факторинга', 'По итогам 1 квартала 2019 года Альфа-Банк занял первое место по объему портфеля импортного факторинга, согласно данным Ассоциации факторинговых компаний (АФК). Доля банка на этом рынке составила рекордные 65%, объем задолженности клиентов по импортным контрактам — 1,4 млрд рублей. При этом совокупный факторинговый портфель банка за тот же период превысил 62 млрд рублей.\n«Альфа-Банк является безусловным лидером рынка импортного факторинга. Мы единственными в России осуществляем прямое финансирование импортных закупок. Крупные корпоративные клиенты Альфа-Банка могут работать с зарубежными поставщиками так же легко, как и с российскими. Они сразу получают отсрочку платежа в нужной валюте, избегая посреднических схем с участием зарубежных факторов», — подчеркнул директор по продажам факторинга Альфа-Банка Павел Шишов.\nКроме того, импортный факторинг позволяет оптимизировать оборотный капитал, а зачастую — еще и улучшить условия закупки благодаря предоплате. Если платеж проходит в валюте, Альфа-Банк хеджирует риски покупателя, фиксируя стоимость поставки в рублях по выгодному курсу дилера. \n«Импортный факторинг пользуется высоким спросом у наших клиентов. С его помощью они закупают зарубежные продукты питания, алкоголь, программное обеспечение и другие товары. Помимо собственно финансирования, Банк представляет полный спектр услуг по валютному контролю, конвертации и сопровождению сделки», — отметил Павел Шишов.\nАссоциация факторинговых компаний — профессиональное общественное объединение участников рынка факторинга в Российской Федерации. Рейтинг подготовлен на основе предварительных данных о развитии бизнеса участников АФК и других российских факторов в 1 квартале 2019 года. Ознакомиться с его результатами можно по ссылке: http://asfact.ru/events/portfel-uchastnikov-afk-po-itogam-1-kvartala-2019-goda-490-mlrd-rubley/.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-22', 'false'),
	(14, 'Альфа-Банк', 'Генеральный партнер арт-шоу DA!MOSCOW — Альфа-Банк — предоставляет особые условия на покупку билетов для своих клиентов', 'DA!MOSCOW открывает продажу билетов, расширяет список галерей-участников и публикует дискуссионную программу арт-шоу. Генеральный партнер проекта — Альфа-Банк — предоставляет особые условия на покупку билетов для своих клиентов.\n\nЕжегодное арт-шоу DA!MOSCOW, которое состоится 17-19 мая в Гостином дворе, открывает продажу билетов\n  на своем сайте. Генеральный партнер арт-шоу — Альфа-Банк — предоставил специальные условия для держателей своих карт: они\n  могут приобрести билеты на ярмарку DA!MOSCOW с 20% скидкой по любой карте банка. Владельцам премиальных карт Mastercard Black Edition и World Elite, Visa Signature и Infinite доступны 2 бесплатных билета. Условия применяются автоматически при оплате на сайте — для этого достаточно ввести номер карты Альфа-Банка.\n\nДискуссионная программа арт-шоу включает в себя следующие мероприятия:\n\n  панельную сессию «Музей современного искусства: реальный и идеальный» о принципах организации работы идеального музея: от формирования коллекции до взаимодействия с частными коллекционерами и бизнесом;\n  две встречи Artist-talk — с выступлениями культовых художников современности о себе и о том, что их волнует сегодня;\n  два публичных диалога молодых художников с галеристами.\n\n«Продолжая многолетнюю традицию, Альфа-Банк рад содействовать развитию современного искусства. Уверен, что коллекционеры оценят представленные работы и многие из них окажутся в частных собраниях. DA!MOSCOW — амбициозный проект, я желаю ему успеха», — отмечает Председатель Совета директоров Альфа-Банка Петр Авен.\n\n«Пока наши лучшие художники и галереи не создадут серьезную конкурентную среду в России, пока наши коллекционеры не научатся серьезно поддерживать их деятельность, до тех пор никто с нами в мире считаться не будет. Американцы сначала поддерживают американских художников, потом всех остальных, немцы — немецких, китайцы — китайских. По-другому не бывает. Россия — не исключение. И мы докажем, что такое сотрудничество возможно. У нас великая история коллекционирования, имена Третьякова, Щукина и Морозова запомнятся навсегда. И работы Малевича — в золотом фонде мирового искусства. Надо продолжать и быть впереди всех!» — говорит Владимир Овчаренко.\n\nУчастники арт-шоу: 11.12 Gallery, Anna Nova Gallery, Askeri Gallery, Aspan Gallery, Didi Art Gallery, Fine Art Gallery, Fragment Gallery, Heritage Gallery, Krokin Gallery, Marina Gisich Gallery, Osnova Gallery, Ovcharenko, PA Gallery, Szena, Totibadze Gallery, Gallery Triangle, Triumph Gallery, VP Studio, Арт4, Галерея Веллум, Галерея им. братьев Люмьер, Галерея Глаз, Галерея Палисандр, Галерея Х.Л.А.М.\n\nПартнер проекта — отель «Балчуг Кемпински Москва», расположенный в самом центре столицы.\n\nСледите за новостями DA!MOSCOW на \n  сайте и в социальных сетях: @damoscow.art в \n  Instagram and\n  \n    "Facebook.\n\n				\n				Владимир Овчаренко — коллекционер, основатель одной из первых в России галерей современного искусства OVCHARENKO и первого аукциона российского современного искусства «VLADEY». \n\nC середины 90-х годов галерея (до 2018 года — Regina Gallery) — постоянный участник международных ярмарок, в том числе Art Basel и Frieze. OVCHARENKO сотрудничает с художниками, чьи работы и идеи востребованы как в России, так и за рубежом. Среди известных в мире авторов галереи — Виктор Алимпиев, Сергей Братков, Сергей Зарва, Павел Пепперштейн, Иван Чуйков, Семён Файбисович. OVCHARENKO постоянно предоставляет работы своих художников для крупных международных проектов и биеннале современного искусства, их работы находятся в ведущих музеях мира: MoMa (Нью-Йорк), Тейт Модерн (Лондон), Центре Помпиду (Париж). \n\nVLADEY — первый в России аукцион современного искусства, созданный в 2013 году и завоевавший авторитет среди художников и коллекционеров. Вечерние торги проводятся дважды в год весной и осенью; на кураторских торгах работы отбираются приглашенным экспертом, аукционы «Все по 100» (стартовая цена на все лоты — €100) стали новым словом в мировой аукционной практике. Торги транслируются в прямом эфире, а у покупателей есть возможность делать ставки из любой точки мира. Средний процент проданных работ на торгах — 75%, что по мировым меркам считается очень высоким результатом. За четыре года существования VLADEY на аукционе были проданы произведения более 250 российских авторов, для большинства из них это были первые аукционные результаты.\n\nПетр Авен — член наблюдательного совета консорциума «Альфа-Групп», председатель совета директоров Банковской группы «Альфа-Банк». Кандидат экономических наук, профессор Государственного университета Высшая Школа Экономики. Является членом Совета директоров Российской Экономической Школы; членом Попечительского Совета МГУ им. Ломоносова; членом Президентского Совета по международным отношениям Йельского университета (США). Член Попечительского Совета Государственного музея изобразительных искусств имени А. С. Пушкина; член Попечительского Совета Русского географического общества; Попечитель Королевской Академии искусств (Великобритания). Активно поддерживает искусство и театр в России. Владеет крупнейшей в России коллекцией произведений русского искусства начала двадцатого века, постоянно пополняет ее. В состав коллекции Петра Авена входят работы Кандинского, Шагала, Гончаровой, Ларионова, Кончаловского, Петра-Водкина, Серова, Коровина, Лентулова, Судейкина, Серебряковой, Анненкова, Древина, Удальцовой и многих других выдающихся художников. Также увлекается современной скульптурой. Среди его приобретений можно отметить работы Генри Мура и Луизы Буржуа. \n\nАльфа-Банк. Будучи крупнейшим частным банком в России, Альфа-Банк ассоциируется не только с наиболее передовыми технологиями и высоким качеством клиентского обслуживания, но и с яркими проектами, которые внесли вклад в сохранение российского культурного наследия. Благодаря его финансовой поддержке отреставрированы знаменитый Российский павильон в Венеции и объект всемирного наследия ЮНЕСКО — Каслинский павильон в Екатеринбурге. Альфа-Банк активно содействует развитию и продвижению современного искусства. В числе крупных международных событий, состоявшихся при его участии, — выставки работ Казимира Малевича в Музее Гуггенхайма в Нью-Йорке и Галерее Тейт Модерн в Лондоне. Начиная с 2017 года, Альфа-Банк сотрудничает с компанией Smart Art, помогая обрести широкое признание перспективным российским художникам. При его поддержке в Москве состоялись дебютная выставка Дарьи Иринчеевой «Пустое знание» и выставка Александры Паперно «Любовь к себе среди руин». В 2018 году Альфа-Банк привез в Екатеринбург одно из самых знаковых полотен ХХ века — картину К. Петрова-Водкина «Купание красного коня». Уникальный экспонат был предоставлен Третьяковской галереей для выставки «Дар Казимиры Басевич музеям России», объединившей работы таких знаменитых художников, как Н. Рерих, Б. Кустодиев, М. Врубель, А. Бенуа. Альфа-Банк выступил генеральным спонсором этого проекта, ставшего данью памяти трем поколениям семьи Басевич-Лотаревых, передавшим свою коллекцию в дар российским музеям.\n\nДля дополнительной информации просьба обращаться в пресс-службу DA!MOSCOW:\n\nАлена Соловьева\n+7 (965) 445-50-62\nasoloveva@monstars.ru\n\nАнастасия Федорова\n+7 (916) 855-28-69\nafedorova@monstars.ru \n\nПресс-служба Альфа-Банка: \n\nЕкатерина Моисеева\nмоб.: +7 (916) 572-93-84\nEVMoiseeva@alfabank.ru\n\nЕлена Резниченко\nМоб.: +7 (916) 820-58-69\nEReznichenko@alfabank.ru\nPress@alfabank.ru\n\nАльфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре.\n			', '2019-04-18', 'false'),
	(15, 'Альфа-Банк', 'Альфа-Банк упрощает процедуру кредитования малого бизнеса — для кредитов до 3 млн рублей достаточно иметь положительную кредитную историю', 'Альфа-Банк запустил экспресс-технологию кредитования малого бизнеса — по кредитам до 3 млн рублей Банк принимает решение в течение нескольких часов, оценивая только кредитную историю заемщика. \nОт заемщика не требуется залога и официальной отчетности, подтверждающей его финансовое состояние. \nБлагодаря скоринговой модели, построенной на анализе кредитной истории, Банк может в автоматическом режиме с высокой степенью точности оценить платежеспособность потенциального заемщика.\nСтавки по кредитам на основе экспресс-решений, не будут отличаться от стоимости кредитов, выданных по классической процедуре (14-17% годовых в зависимости от суммы и срока кредитования). \nУслуга доступна для юрлиц или индивидуальных предпринимателей, независимо от того, обслуживались ли они ранее в Альфа-Банке.\nЗаявку на кредит можно оставить на сайте Банка, через контакт-центр либо обратившись в отделение.\nБанк запрашивает у заемщика минимум информации, необходимой для его идентификации и обработки кредитной истории в рамках установленных законом процедур. \n«Наличие положительной кредитной истории у представителей малого бизнеса — это показатель определенной финансовой культуры и дисциплины собственников бизнеса и подтверждение реального срока работы компании. Поэтому кредитование на основе исключительно кредитной истории позволит нам сохранить контроль над рисками и привлечь наиболее качественных, ответственных заемщиков малого бизнеса, — отмечает руководитель блока „Малый бизнес“ Альфа-Банка Денис Осин. ­— Оформление кредита в рамках классической процедуры обычно занимает 1-2 недели, заемщику требуется подготовить пакет документов, подтвердить финансовое состояние. Мы поощряем клиентов с положительной кредитной историей, предлагая им заемные средства по той же ставке, что и по классическим кредитным процедурам, но в максимально сжатые сроки и без сбора какой-либо дополнительной документации. Малому бизнесу необходимы простые и быстрые кредитные решения — мы убеждены, что наше предложение будет востребовано и продемонстрирует предпринимателям важность формирования положительной кредитной истории, которая открывает доступ к упрощенному финансированию».\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-18', 'false'),
	(16, 'Альфа-Банк', 'Альфа-Банк поздравил победителей олимпиады «Покори Воробьёвы горы!»', '16 апреля Альфа-Банк торжественно вручил призы победителям олимпиады «Покори Воробьёвы горы!» — обладателям дипломов I степени. \nПартнером многопрофильной олимпиады, которую ежегодно проводят МГУ имени М.В. Ломоносова и издательский дом «Московский Комсомолец», Альфа-Банк стал впервые. Основная цель проекта — поиск и поддержка талантливых школьников 5-11 классов из самых удаленных уголков нашей необъятной страны. \nВ рамках олимпиады ребята могут выполнить задания по биологии, географии, журналистике, иностранным языкам, истории, литературе, математике, обществознанию и физике.\n«Участие в таких интеллектуальных соревнованиях — это большая честь и высокая ответственность для каждого из ребят, которые представляют не только свою школу, но и регион, — отметил Олег Николаевич Сысуев, Первый заместитель Совета директоров Альфа-Банка. — Инвестируя в талантливую молодежь с разносторонними интересами, мы заботимся о будущем государства, в котором живем. Именно поэтому мы активно развиваем нашу стипендиальную программу, которая уникальна тем, что поддерживает одаренных ребят в самом начале их обучения в вузе — на первом и втором курсе. Мы очень горды тем, что программа „Альфа-Шанс“ сотрудничает с крупнейшими вузами страны, и уверены, что МГУ имени М.В. Ломоносова станет яркой жемчужиной в ряду этих университетов».\n«Дорогие ребята, благодарю вас всех за участие в олимпиаде! Этот проект возник наряду с другими олимпиадами, но для меня он является особой гордостью. Ведь именно благодаря ПВГ школьники из глубинки, из отдаленных регионов нашей страны смогли стать частью олимпиадного движения. Лучшим доказательством всему служит время. Спустя 15 лет после старта олимпиады „Покори Воробьёвы горы!“ можно констатировать, этот проект получился прекрасным, именно таким, каким мы и хотели его видеть. Среди победителей первых сезонов уже есть доктора наук, состоявшиеся в различных сферах и успешных людей. От всей души поздравляю всех победителей и призеров и, конечно же, призываю вас поступать в МГУ. Надеюсь, что через 4-5 лет буду в этих стенах вручать кому-то из вас дипломы с отличием», — обратился к победителям Виктор Антонович Садовничий, Ректор МГУ имени М.В. Ломоносова.\n«Хочу выразить благодарность Виктору Антоновичу и его команде, которые помогают растить поколение умных и порядочных ребят, мечтающих продвигать вперёд нашу науку, — отметил Павел Гусев. — Школа МГУ — это высочайшее достижение и преподавателей, и самих студентов. Нам очень приятно смотреть на ваши молодые лица, горящие глаза. Мы завидуем вам, потому что самое важное у вас впереди, сейчас вы только в начале своего большого пути к вершине. Говоря о больших жизненных достижениях, хочу представить всем присутствующим, известного российского финансиста и политика, Олега Николаевича Сысуева, первого заместителя председателя совета директоров Альфа-Банка. Хочется отметить, что, когда строился Ломоносовский корпус, в котором мы сейчас находимся, Олег Николаевич работал заместителем председателя правительства РФ и курировал этот проект, а в этом году он подготовил для всех победителей олимпиады интеллектуальные подарки. Поздравляем Вас с первой большой победой на олимпиаде МК и МГУ «Покори Воробьёвы горы!».\nНачиная с 2019 года, будущие студенты-первокурсники МГУ имени М.В. Ломоносова, поступившие в университет по итогам олимпиады «Покори Воробьёвы горы!», получат возможность принять участие в конкурсе на стипендию «Альфа-Шанс». Эта стипендиальная программа была учреждена Альфа-Банком в 1995 году. В настоящее время она реализуется в 18-ти ведущих вузах России и поддерживает выдающихся студентов начальных курсов. Программа является полностью благотворительной, так как стипендиаты не имеют перед Альфа-Банком никаких обязательств. Планируется, что ежегодно в МГУ имени М.В. Ломоносова будет отбираться группа из 20 стипендиатов, которые будут получать от Альфа-Банка по 10 тысяч рублей ежемесячно.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-17', 'false'),
	(17, 'Альфа-Банк', 'Кредитная карта «100 дней без %» Альфа-Банка теперь доступна в Евросети', 'Альфа-Банк и объединённая компания Связной | Евросеть объявляют о расширении сотрудничества: теперь и в магазинах Евросети клиенты могут оформить кредитную карту «100 дней без %» от Альфа-Банка. Услуга доступна во всех магазинах ритейлера на территории страны.\nОсновными преимуществами карты являются — возможность пользоваться кредитным лимитом без процентов 100 дней, опция погашения задолженности в других банках без комиссий и снятие наличных в банкоматах любых банков без процентов до 50 тысяч рублей в месяц. При этом кредит можно погасить без комиссии онлайн, картами других банков или наличными в банкоматах банка и банков-партнеров.\n«Благодаря нашему сотрудничеству оформить карту в любой точке ритейлера очень быстро и просто. Процесс занимает не более 30 минут. И для этого потребуется всего 1 документ. Кроме того, наши клиенты, заполнившие анкету на кредитную карту на сайте банка, могут в течение 10 минут получить ее в любом из магазинов сети» — прокомментировал руководитель дирекции развития бизнеса в партнерском канале розничного бизнеса Альфа-Банка Даниил Поколодный.\n«Аналогичная услуга в магазинах Связной показала свою востребованность. Так, например, с момента запуска услуги в сентябре прошлого года клиенты оформили более 80 тыс. карт. Поэтому масштабирование услуги на Евросеть является логичным продолжением нашего проекта с Альфа-Банком», — отметил директор телекоммуникационных и финансовых услуг в объединенной компании Связной | Евросеть Антон Павлов.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-17', 'false'),
	(18, 'Альфа-Банк', 'Альфа-Банк открыл в Москве ипотечный центр', '16 апреля 2019 года Альфа-Банк открыл в Москве ипотечный центр по адресу Звенигородское шоссе 18/20. Место было выбрано не случайно: здесь пересекаются как транспортные, так и пешеходные потоки. В новом отделении созданы максимально комфортные условия для обслуживания клиентов. В офисе можно получить консультации по финансовым услугам и объектам недвижимости, подписать договор купли-продажи или уступки, заключить договор страхования. Специалисты Банка будут консультировать жителей столицы по вопросам получения ипотеки, а также оказывать им поддержку при заключении сделки. Процесс оформления, включая заключение сделки, оформление страховки и передачу денег, происходит в одном месте — Центре ипотечного кредитования. \nСпециально для ипотечных клиентов был также разработан новый цифровой сервис — личный кабинет ипотечного заемщика на сайте Альфа-Банка, который упрощает и ускоряет процесс оформления ипотеки. Еще одно важное преимущество программы Банка — большое количество каналов погашения кредита: внести взнос по кредиту можно в любом отделении Альфа-Банка по всей стране независимо от места выдачи кредита, а также в мобильном и интернет-банке и банкоматах.\n«В 2019 году Альфа-Банк продолжит активное развитие розничного бизнеса и расширение географии присутствия ипотеки банка. Сегодня мы открыли второй ипотечный центр в Москве и до конца года планируем открыть в столице еще один и более десяти в регионах. Это позволит значительно нарастить ипотечный портфель как благодаря широкому выбору программ и ставкам на уровне лучших предложений рынка, так и за счет улучшения клиентского сервиса и сокращения времени обслуживания заемщиков на всех этапах — от подачи заявки до получения кредита», — прокомментировал директор по ипотечному развитию Альфа-Банка Артем Иванов. \nСегодня банк выдает ипотеку в Москве, Санкт-Петербурге, Краснодаре, Ростове-на-Дону и Екатеринбурге. До конца года еще в 12 городах присутствия Банка клиенты смогут оформить ипотечные кредиты.\nАльфа-Банк предлагает различные программы ипотечного кредитования на вторичном рынке недвижимости — займы с минимальным первоначальным взносом от 10% стоимости жилья, а также кредит под залог находящейся в собственности квартиры. Получить ипотеку на покупку строящегося жилья в Альфа-Банк можно по ставке от 9,99% годовых в рамках специального предложения, на покупку готового жилья — по ставке от 10,49%. В рамках программ рефинансирования банк предлагает процентную ставку от 10,29% годовых. Срок ипотечного кредита в Альфа-Банке составляет от трех до 30 лет.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-16', 'false'),
	(19, 'Альфа-Банк', 'Альфа-Банк выступил одним из организаторов выпуска биржевых облигаций буровой компании «Евразия» объемом 15 млрд рублей', 'Альфа-Банк выступил одним из организаторов выпуска биржевых облигаций ООО «Буровая компания Евразия» серии БО-001P-02. Первоначальный ориентир ставки купона составлял 8.60 — 8.75% годовых, что соответствует эффективной доходности к погашению 8.78 — 8.94% годовых. Первоначальный индикативный объем сделки составлял не менее 10 млрд. рублей.\nВысокий интерес к выпуску в ходе сбора заявок позволил эмитенту несколько раз пересмотреть ориентир по купону и установить финальную ставку купона ниже первоначального диапазона — на уровне 8.55% годовых, что соответствует доходности 8.73% годовых, а также увеличить объем размещения до 15 млрд. руб. В ходе бук-билдинга было подано 35 заявок от инвесторов, максимальный спрос на облигации превышал 28 млрд. рублей.\n«Это первая сделка Альфа-Банка с эмитентом на публичном долговом рынке, которая стала продолжением нашего многолетнего партнерства. Мы рады, что размещение оказалось столь успешным. Благодаря высокому интересу инвесторов к облигациям компании удалось увеличить размер книги с 10 до 15 млрд рублей и снизить итоговый купон до 8,55% годовых», — отметил директор отдела долгового капитала Альфа-Банка Дэвид Мэтлок.\n«Данный выпуск, ставший уже третьим на российском локальном рынке облигаций, еще раз подтверждает стратегическую важность данного рынка для нас. При этом мы видим, что инвесторы проявили доверие и оценили высокое кредитное качество компании, показав повышенный интерес к нашему выпуску», — прокомментировал результаты бук-билдинга главный финансовый директор Eurasia Drilling Company Limited Талех Магомедович Алескеров.\nСрок обращения выпуска — 3 года с момента начала размещения. Купонный период составляет 6 месяцев, номинальная стоимость облигаций — 1 000 рублей, а цена размещения — 100% от номинала. Также по выпуску предусмотрена публичная безотзывная оферта от материнской компании: Eurasia Drilling Company Limited.\nТехническое размещение бумаг состоится 23 апреля 2019 года на Московской Бирже. Организаторами сделки выступили АО Альфа-Банк, ПАО Росбанк, ПАО Совкомбанк.\nВыпуск организован в рамках бессрочной программы биржевых облигаций ООО «Буровая компания «Евразия», зарегистрированной Московской Биржей 26 апреля 2016 года под идентификационным номером 4-36403-R-001P-02E.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-12', 'false'),
	(20, 'Альфа-Банк', 'Альфа-Банк выступил одним из организаторов выпуска биржевых облигаций ПАО «Детский мир» объемом 5 млрд рублей', 'Альфа-Банк выступил одним из организаторов выпуска биржевых облигаций лидера сегмента детских товаров в России — ПАО «Детский мир». Это первая совместная сделка Альфа-Банка с эмитентом на публичном долговом рынке. Объем выпуска составил 5 млрд рублей. Первоначальный диапазон по ставке купона составлял 9,0%-9,2% годовых, книга заявок закрыта на уровне 8,9% годовых.\n«В результате букбилдинга нам удалось значительно снизить купон — на 0,3%. Надеемся, что эта успешная дебютная сделка станет базой для долгосрочного партнерства Альфа-Банка и ПАО „Детский мир“ на рынке долгового капитала», — отметил директор отдела долгового капитала Альфа-Банка Дэвид Мэтлок. \n«ПАО „Детский мир“ — стратегический клиент Альфа-Банка. Мы рады успешной реализации сделки и уверены, что она послужит укреплению отношений с компанией, а также ее акционером, АФК „Система“», — подчеркнул старший банкир Альфа-Банка Борис Медовой.\nСрок обращения выпуска составляет 7 лет, предусмотрена оферта через 3 года с даты начала размещения. Купонный период составляет 182 дня. Номинальная стоимость облигации — 1 000 рублей. Техническое размещение запланировано на 15 апреля. Организаторами сделки выступили Альфа-Банк, Газпромбанк, Райффайзенбанк.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-12', 'false'),
	(21, 'Альфа-Банк', 'Альфа-Банк сообщает о погашении облигаций и выплате купонного дохода', 'Доводим до Вашего сведения, что сегодня Альфа-Банк выполнил обязательства по выплате процентного дохода по шестому купону биржевых облигаций серии БО-12 в объеме 3 205 778,40 рублей, а также выполнил обязательства по погашению данных облигаций в связи с окончанием срока их обращения.\nПараметры выпуска серии БО-12 — ISIN: RU000A0JWCL2, идентификационный номер 4B021201326B от 19.07.2012, объем эмиссии — 5 млрд. рублей, дата размещения — 12.04.2016, дата погашения — 12.04.2019. Дата начала шестого купонного периода — 12.10.2018, дата окончания — 12.04.2019, текущая ставка купона — 6,75%, периодичность выплаты купона — 2 раза в год. \nКупонный доход выплачен в срок и в полном объеме, облигации погашены в срок и в полном объеме.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-12', 'false'),
	(22, 'Альфа-Банк', 'Глава розничного бизнеса Альфа-Банка Майкл Тач вошел в состав правления банка', 'Руководитель розничного бизнеса Альфа-Банка Майкл Тач назначен на должность Заместителя Председателя Правления и вошел в состав Правления. Кандидатура Майкла Тача прошла все необходимые согласования и была одобрена ЦБ РФ.\nК команде Альфа-Банка Майкл Тач присоединился в 2017 году. Он занимает пост руководителя розничного блока, в состав которого входит также Private Banking. С 2008 года выступил в роли финансового директора группы «Связной», а в 2013 году возглавил компанию уже в качестве генерального директора. В 2016 году Майкл Тач был назначен на должность исполнительного директора розничной сети «М.Видео».\nМайкл Тач получил образование в Университете Мэриленда в США по специальности «Экономика и финансы». Сразу после окончания Университета в 1998 году он начал свою карьеру в компании GE Capital, где управлял проектами в 12 странах мира и развивал бизнес в США, Мексике и России. Работая в GE Money Bank Russia, занимал пост финансового директора.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-10', 'false'),
	(23, 'Альфа-Банк', 'Облигации Альфа-Банка включены в высший котировальный список Московской Биржи', 'Сегодня Московская биржа приняла решение включить биржевые облигации АО «АЛЬФА-БАНК» объемом 10 млрд. рублей серии 002Р-04 (идентификационный номер выпуска — 4B020401326B002P от 09.04.2019) в первый уровень списка ценных бумаг, допущенных к торгам на бирже. Техническое размещение облигаций данного выпуска пройдет на Московской бирже 12 апреля 2019 года, книга заявок была закрыта 02 апреля 2019 года. Напомним, что по итогам букбилдинга ставка купона установлена на уровне 8,55% годовых со сроком до погашения через 2 года.\nТакже сегодня Московская биржа приняла решение о переводе с 11 апреля ранее размещенных выпусков Альфа-Банка из разделов «третий уровень» и «второй уровень» в раздел «первый уровень». Переводятся 3 выпуска облигаций на сумму 25 млрд рублей, все они были размещены в 2018 году:\n\nсерии 002Р-01, идентификационный номер– 4B020101326B002P от 26.07.2018, ISIN – RU000A0ZZEW4;\nсерии 002Р-02, идентификационный номер выпуска – 4B020201326B002P от 25.10.2018, ISIN код – RU000A0ZZRB0.\nсерии 002Р-03, идентификационный номер выпуска – 4B020301326B002P от 17.12.2018, ISIN код – RU000A0ZZZ66.\n\nВозможность обращения бумаг Альфа-Банка в первом уровне котировального списка Московской биржи свидетельствует о высокой надежности банка как эмитента и высоком качестве его облигаций. Сегодня листинговые требования для высшего уровня котировального списка жестко формализованы Московской биржей, их определяет ЦБ РФ. Среди важнейших критериев — финансовые показатели и кредитный рейтинг, также действуют строгие требования к качеству корпоративного управления.\nПервый уровень позволит приобретать облигации банка тем инвесторам, которым ранее в силу каких-либо законодательных ограничений они были недоступны, а также даст возможность увеличить вложения в ценные бумаги Альфа-Банка инвесторам, у которых имеются какие-либо ограничения на покупку облигаций более низких уровней. Таким образом, решение биржи окажет положительное долгосрочное влияние на ликвидность как уже обращающихся, так и новых, планируемых к размещению, выпусков банка.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-09', 'false'),
	(24, 'Альфа-Банк', 'Альфа-Банк получил две награды за инновационные страховые продукты в мобильном банке', 'В конце марта и начале апреля цифровая команда Альфа-Банка получила две новые отраслевые награды за результаты в создании инновационных страховых продуктов в мобильном банке. \n23 марта были объявлены победители отраслевой премии FinAward от издательства «Банковское Обозрение». Совместные цифровые продукты Альфа-Банка и АльфаСтрахования, запущенные в мобильном банке, завоевали награду в номиации «Инновации в банковском страховании». Кроме того, 2 апреля в рамках форума страховых инноваций InnoIns-2019, состоялось награждение победителей отраслевой премии «Эврика», лауреатом в персональной номинации «Визионер страховой цифровизации» стал Владимир Китляр, лидер команды digital-insurance Альфа-Банка. \n«Страховые продукты очень органично интегрируются в банковскую цифровую среду, — комментирует Иван Пятков, Директор по цифровому бизнесу и инновациям. — Именно в мобильном банкинге, при правильной реализации, страховая защита доставляется клиенту максимальной деликатно и своевременно, в очень удобном безбумажном формате, одновременно обогащая возможности мобильного банка и обеспечивая очень заметный комиссионный доход. Индустрия цифрового банковского страхования еще только стартует, но очень активно развивается, во многом благодаря эффективному использованию огромной экспертизы, накопленной нами в практике разработки digital-банкинга, с безусловным фокусом на мобильный банк». \nРаботу над инновациями в сфере безбумажных страховых продуктов Digital-команда банка ведет совместно с продуктовой командой АльфаСтрахования. Эффективное партнерство дружественных компаний группы — одна из ключевых основ высокого качества и скорости при создании инновационных безбумажных продуктов страхования.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-08', 'false'),
	(25, 'Альфа-Банк', 'Клиенты Альфа-Банка могут снимать наличные через банкоматы банка «Открытие» без комиссии', 'С 8 апреля 2019 года клиенты Альфа-Банка могут снимать наличные денежные средства без дополнительных комиссий в одной из наиболее развитых сетей устройств самообслуживания на российском банковском рынке — банкоматах банка «Открытие». Уже сегодня объединенная сеть включает в себя более 25 тысяч устройств в 2,8 тыс. городах и населенных пунктах России, и эта сеть будет постоянно расти. И клиенты Альфа-Банка, и клиенты банка «Открытие» получают возможность пользоваться устройствами обоих банков на одинаковых условиях.\nОбъединенная сеть позволит существенно расширить географию пользования банковскими услугами. Держатели банковских карт обоих банков смогут воспользоваться объединенной банкоматной сетью, широко представленной в различных городах России, в т.ч. в тех, где ранее это не было возможным. Выдача наличных денежных средств через банкоматную сеть банка «Открытие» доступно как частным клиентам, так и держателям корпоративных карт «Альфа-Cash» — удобного инструмента работы с выручкой и совершения покупок для предпринимателей и компаний малого и среднего бизнеса.\n«Объединяя сети банкоматов, мы, в первую очередь, заботимся об удобстве и комфорте наших клиентов, повышаем доступность банковских услуг и предлагаем дополнительные решения. Теперь клиенты нашего банка получили возможность совершать привычные банковские операции в банкоматах банка „Открытие“ так же легко, как они привыкли это делать в устройствах Альфа-Банка», — говорит руководитель розничного бизнеса Альфа-Банка Майкл Тач.\nНа сегодняшний день у Альфа-Банка общая объединенная банкоматная сеть на выдачу наличных с такими банками как Промсвязьбанк, Росбанк, УБРиР, Россельхозбанк, Московский кредитный банк и Газпромбанк.\nОбъединение банкоматных сетей позволяет значительно повысить качество и доступность услуг для физических и юридических лиц, а также обеспечивает клиентов удобным сервисом использования банковских карт на территории всей страны.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-08', 'false'),
	(26, 'Альфа-Банк', 'Cтратегия развития Альфа-Банка до 2021 года', 'Совет директоров Альфа-Банка утвердил стратегию развития банка на 2019-2021 гг. Заявленная в стратегии цель — переход на новый технологический уровень, который позволит банку предложить лучшие сервисы для клиентов, обеспечит бесспорные конкурентные преимущества на меняющемся банковском рынке и станет базой для повышения прибыльности и роста рыночной доли банка. \nНовая стратегия Альфа-Банка — стратегия концентрированного роста: сохраняя преемственность задачи по удвоению рыночных позиций, банк сосредоточится на самом главном. «Чтобы быть готовыми к постоянным переменам в банковской отрасли, мы должны непрерывно оставаться на острие технологий и клиентского опыта, — заявил главный управляющий директор Альфа-Банка Владимир Верхошинский. — Наша стратегия очень четко сфокусирована — мы выделили всего три цели, но в них наша амбиция — стать лучшими в стране». \nВ стратегии Альфа-Банк ставит себе задачу за три года стать лидером по трем направлениям.\n\n    Альфа-Банк создаст лучшее мобильное приложение в России. Мобильный банк станет центром взаимодействия с физическими лицами и предпринимателями, в нем будет сосредоточен максимально широкий набор продуктов и сервисов банка, в том числе тех, что сегодня доступны только в отделениях. При этом Альфа-Банк не идет в идеологию mobile only (т.е. развитие только мобильного банка), а будет развивать все каналы взаимодействия с клиентами, руководствуясь принципом mobile first (первоочередной выпуск продуктов для мобильного банка).\n    К 2021 году Альфа-Банк полностью реализует концепцию первого в России безбумажного универсального банка, отказавшись от бумаги в отделениях и бэк-офисе: везде, где это не является требованием законодательства или клиентов. Это будет достигнуто за счет активного использования биометрии и повсеместного внедрения электронной цифровой подписи в клиентские и бэк-офисные операции как физических, так и юридических лиц. У клиентов появится возможность обслуживаться в отделениях без паспорта и карт, только со смартфоном.\n    В ближайшие три года банк будет трансформировать сеть отделений в сеть нового поколения, что позволит дать нашим клиентам качественно новый клиентский опыт. Благодаря цифровизации процессов клиенты Альфа-Банка будут обслуживаться в отделениях без паспорта и бумажных документов по всему перечню банковских и инвестиционных продуктов, имея только смартфон.\n\nКлючевые финансовые цели стратегии предусматривают рост клиентского кредитного портфеля до $45 млрд в 2021 году по МСФО, наращивание комиссионного дохода до $1,4 млрд в 2021 году. С 2021 года банк должен полностью покрывать операционные расходы за счет безрисковых доходов.\nРост масштабов бизнеса должен сопровождаться повышением операционной эффективности — показатель CIR в 2021 году будет стабильно не выше 38% — и сохранением высокой прибыльности (ROE ~15%). Это позволит банку устойчиво наращивать капитал — почти до $9 млрд в 2021 году.\nСтратегия предусматривает значительный прирост клиентской базы — в 2021 году число розничных клиентов достигнет 7,4 млн человек, клиентов сегмента микро- и малого бизнеса — превысит 600 тысяч, среднего бизнеса — 75 тысяч компаний. Это соответствует росту ~50% в каждом из указанных сегментов.\nВ розничном кредитовании банк ставит задачу кратного роста портфелей: портфель кредитных карт вырастет в 2 раза, кредитов наличными — в 2,7 раз, ипотека — в 7,5 раз. Такая динамика позволит банку удвоить долю на рынке розничного кредитования — цель ~5,3% в 2021 году.\nКредитование микро- и малого бизнеса вырастет четырехкратно — портфель превысит $1,4 млрд. Темпы роста корпоративно-инвестиционного бизнеса будут соответствовать рыночным с сохранением прибыльности на текущем уровне. \n«Локомотивом роста активов банка и его прибыли будет регулярный бизнес: розница, малый и средний бизнес. Два года назад мы взяли курс на удвоение доли рынка в этих сегментах и уже прошли половину пути. В 2018 году розничный кредитный портфель вырос на 76%, в этом году он снова вырастет минимум в полтора раза. Клиентская база физлиц за год увеличилась почти на 20%, корпоративных клиентов — на 25%. В результате в 2021 году вклад регулярного бизнеса в прибыль банка составит 70%. Сейчас эта доля — 50%», — указал главный управляющий директор Альфа-Банка Владимир Верхошинский.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-04', 'false'),
	(27, 'Альфа-Банк', 'Альфа-Банк размещает биржевые облигации на 10 млрд рублей', 'Альфа-Банк закрыл книгу заявок на собственные биржевые облигации (серия 002Р-04) на сумму 10 млрд рублей. По итогам букбилдинга ставка купона установлена на уровне 8,55% годовых со сроком до погашения через 2 года. \nРазмещение облигаций запланировано на 12 апреля 2019 года. Организатором выпуска выступил сам Альфа-Банк.\n«В последние несколько недель на рынке наблюдалась относительно стабильная ситуация. Несмотря на большое число размещений локальных облигаций, спрос инвесторов на бумаги Альфа-Банка был внушительным: книга заявок на пике превышала 25 млрд рублей. После четырех понижений ценового диапазона мы закрыли сделку на 35 базисных пунктов ниже первоначально объявленного ценового диапазона. Привлекаемый объем средств и цена полностью отвечают нашим текущим потребностям», — подчеркнул заместитель председателя правления, главный финансовый директор Альфа-Банка Алексей Чухлов.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-03', 'false'),
	(28, 'Альфа-Банк', 'Альфа-Банк нарастил выдачу потребительских кредитов почти в два раза', 'По итогам первого квартала 2019 года Альфа-Банк выдал более 124 тысяч потребительских кредитов на общую сумму 60,5 млрд рублей, что на 24,6 млрд больше, чем за аналогичный период прошлого года. Портфель кредитов наличными по состоянию на 1 апреля превысил 269 млрд рублей. Доля Альфа-Банка на рынке по данным Frank Research Group, превысила 4,46%. За год доля банка выросла на 32%. Средний размер кредита составил 485 тыс. рублей, а средний срок 4 года.\nПотребительский кредит в Альфа-Банке можно оформить по ставке от 11,99% годовых на срок до 5 лет, максимальный размер займа составляет 5 млн рублей. Рефинансировать кредиты сторонних банков клиенты могут по ставке от 11,99% годовых.\n«Спрос на кредиты наличными растет. За последний месяц портфель увеличился на 4%. Этому способствует в том числе и стремительная цифровизация бизнеса. Так, например, мы значительно усовершенствовали процедуру оформления потребительского кредита, теперь его можно получить в мобильном приложении всего за несколько минут. Наша цель — увеличить продажу потребительских кредитов на 48% до конца этого года», — прокомментировала директор по развитию бизнеса потребительского кредитования розничного бизнеса Альфа-Банка Ирина Баранова.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-03', 'false'),
	(29, 'Альфа-Банк', 'Альфа-Банк сообщает о выплате купонного дохода', 'Доводим до Вашего сведения, что сегодня АЛЬФА-БАНК выполнил обязательства по выплате процентного дохода по пятому купону биржевых облигаций серии БО-17 в объеме 236 850 000,00 рублей.\nПараметры выпуска серии БО-17 — ISIN: RU000A0JWUX9, идентификационный номер 4B021701326B от 06.02.2014, объем эмиссии — 5 млрд. рублей, дата размещения — 04.10.2016, дата погашения — 16.09.2031. Дата начала пятого купонного периода — 02.10.2018, дата окончания — 02.04.2019, текущая ставка купона — 9,50%, периодичность выплаты купона — 2 раза в год. \nКупонные доходы выплачены в срок и в полном объеме.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-02', 'false'),
	(30, 'Альфа-Банк', 'VIP-shopping на Монте Наполеоне для клиентов Альфа Private', 'Приезжая в Милан, главное — не упустить возможность воспользоваться привилегиями во время шопинга на одной из самых престижных улиц города Монте Наполеоне, известной своими бутиками итальянских и модных мировых брендов. С 1 апреля 2019 года по 31 января 2020 года Альфа Private предлагает клиентам эксклюзивные условия шопинга при оплате покупок премиальными картами World Elite Mastercard Альфа-Банка. Клиентам Альфа Private, держателям карты World Elite Mastercard, доступны следующие привилегии: \n\n\n10% скидка на проживание в отелях Милана* (включая завтрак на двоих, комплементарный ранний заезд/поздний выезд при наличии номеров в даты обращения). При бронировании номеров категории Junior Suite и выше — трансфер в/из аэропорт(а) Милана на автомобиле Mercedes-Benz представительского класса).\nДвухчасовой индивидуальный шопинг с профессиональным VIP-shopper в бутиках известных брендов в районе Монте Наполеоне. Во время шопинга будет предоставлено привилегированное обслуживание и подарки от брендов в зависимости от конкретной марки**\n\n\nЧтобы воспользоваться предложением, необходимо сообщить своему финансовому советнику за 3 дня до приезда в Милан.\n\nВ периоды проведения Недели дизайна, Недели высокой моды и Гран-при Италии Формулы 1 клиентам необходимо заблаговременно бронировать сервис.\n\n* Отели для размещения: Four Seasons Milan, Mandarin Oriental Milan, Park Hyatt Milan, Bulgari Milan, Armani Milan, Principe di Savoia, Excelsior Hotel Gallia, Me il Duca.\n\n** Услуга предоставляется клиенту один раз за время поездки, в любой день с понедельника по пятницу.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-01', 'false'),
	(31, 'Альфа-Банк', 'Альфа-Банк снизил ставки по ипотеке до 9,99%', 'С 1 апреля 2019 года клиенты Альфа-Банка могут оформить ипотечный кредит на новостройку по ставке от 9,99% годовых в рублях на сумму от 8 млн рублей для Москвы и Московской области и от 6 млн рублей для остальных регионов. Банк снизил ставку на 0,5 пп. \n«Первичное жилье с начала года подорожало на 3-5% и этот фактор мог немного замедлить рост спроса на жилье. Снижение ставок по ипотеке повысит покупательскую активность, что в свою очередь позволит застройщикам проводить более уверенную ценовую политику, — комментирует директор по развитию ипотечного кредитования Альфа-Банка Артем Иванов. Сегодня Альфа-Банк предоставляет наиболее низкие на рынке ставки по ипотеке. Улучшение условий ипотечного кредитования позволит приобрести подходящее жилье и взять кредит под более низкий процент».\nВ Альфа-банке можно получить ипотеку на покупку строящегося жилья по ставке от 9,99% годовых в рамках специального предложения, на покупку готового жилья — по ставке от 10,49%. В рамках программ рефинансирования банк предлагает процентную ставку от 10,29% годовых. Минимальный первоначальный взнос составляет от 15% (при взносе менее 20% применяется надбавка к ставке в размере 0,5 п. п.). Также заемщик может оформить ипотеку по двум документам при увеличении ставки на 0,5 п.п., при первоначальном взносе не менее 40% от стоимости жилья. Срок ипотечного кредита в Альфа-банке составляет от трех до 30 лет.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-01', 'false'),
	(93, 'Восточный банк', 'Банк «Восточный» признан ЦБ РФ значимой кредитной организацией ', ' Банк «Восточный» признан Банком России значимой кредитной организацией на рынке платежных услуг по итогам 2018 года, что отражает значимое место банка на рынке кредитования и существенный вклад в развитие экономики, в том числе в развитие региональной экономики Дальнего Востока.	 В 2018 году были реализованы важные стратегические инициативы, которые значительно поменяли вектор развития банка. Сегодня «Восточный» развивается как универсальный банк – клиентская база расширяется как за счет работы с гражданами, так и с организациями.	 Одним из приоритетных направлений  деятельности банка «Восточный» является развитие карточного бизнеса. Банк  постоянно повышает качество и расширяет линейку продуктов, связанных с использованием банковских карт, которые объединяют в себе инновационные технологии, безопасность, простоту и удобство в расчетах. По данным исследования рынка кредитных карт России по итогам 2018 года, банк «Восточный» входит в топ-5 крупнейших игроков на рынке кредитных карт.	 В Реестр кредитных организаций, признанных Банком России значимыми на рынке платежных услуг, ПАО КБ «Восточный» был включен в апреле 2019 года.	 Признание Банком России кредитной организации значимой на рынке платежных услуг осуществляется на основании таких критериев, как доля осуществленных банком операций с использованием расчетных и кредитных карт, доля эмитированных расчетных и кредитных карт, количество банкоматов и терминалов, доля банка в общем объеме переводов электронных денежных средств, осуществленных в РФ за календарный год и пр.', '2019-04-08', 'false'),
	(91, 'Восточный банк', 'Банк «Восточный» и OneTwoTrip предлагают весенние варианты для путешествия в Европу по специальной цене', 'Банк «Восточный» совместно с сервисом для организации путешествий OneTwoTrip выбрали наиболее интересные направления для весеннего отдыха. Владельцам кредитной «Карты путешественника» предлагаются поездки по специальным ценам в самые атмосферные города Европы: Вену, Берлин, Милан и Ларнаку.	 Напомним, что расплачиваясь «Картой путешественника» банка «Восточный» через портал vostbank.onetwotrip.com, держатели карт, помимо выгодных предложений, получат повышенное количество миль – 10% от своих трат.  На этом ресурсе прямо из дома можно купить авиа- и железнодорожные билеты, забронировать номер в отеле и арендовать автомобиль, а круглосуточная служба поддержки поможет решить любой вопрос, возникший во время поездки по телефону и в мессенджерах.	 Сезонное предложение от банка «Восточный» и OneTwoTrip сделают путешествие не просто приятным и комфортным, но и выгодным.	 Весеннее предложение банк и OneTwoTrip разработали, чтобы подарить клиентам возможность незабываемой поездки в Европу в наиболее оптимальное для каждого из городов время. Направления выбраны с учетом сезонных особенностей европейских городов, динамики туристических потоков и загруженности знаковых достопримечательностей городов.	 В качестве весеннего предложения представлены:	 ·         Москва ⇄ Вена от 9329 рублей	 Проживание от 971 рубля/сутки 	 ·         Москва ⇄ Берлин 8139 рублей	 Проживание от 879 рублей/сутки 	 ·         Москва ⇄ Милан от 9134 рублей	 Проживание от 671 рубля/сутки 	 ·         Москва ⇄ Ларнака от 10551 рубля	 Проживание от 1593 рублей/сутки 	 Подробнее об условиях поездки можно узнать на специальном портале для путешественников банка «Восточный» и сервиса для организации путешествий OneTwoTrip: vostbank.onetwotrip.com.	 Подробнее о «Карте путешественника» – на сайте банка «Восточный»: https://www.vostbank.ru/client/credit-card/kreditnaya-karta-karta-puteshestvennika/.', '2019-04-16', 'false'),
	(92, 'Восточный банк', 'Банк «Восточный» передал весь комплекс Крестовоздвиженского храма в г. Шуя (Ивановская область) Русской Православной Церкви', 'Банк «Восточный» передал Русской Православной Церкви весь комплекс зданий Крестовоздвиженского храма в Ивановской области. Этот дар стал вторым этапом передачи находящихся в собственности банка зданий церкви и был осуществлен в  рамках договора, заключенного год назад между банком «Восточный» и Шуйской епархией. 	 Напомним, что речь идет о Храмовом комплексе, который является объектом культурного наследия федерального значения. В Комплекс входит Храм Воздвижения Креста Господня и Церковь Георгия Победоносца.	 Это памятник русского архитектурного искусства, одна из старейших каменных построек в городе Шуя Ивановской области. Деревянная церковь была возведена в 1629 году, а в 1693 году состоялось освящение уже каменного храма. В XIX веке он стал одним из богатейших во Владимирской губернии, но в начале XX века обе церкви были частично разрушены. Сохранившиеся здания впоследствии вошли в реестр памятников истории и культуры, но позднее попали в частные руки. Несколько лет назад Храмовый комплекс оказался в залоге, а затем и в собственности банка «Восточный».	 Банк инициировал переговоры с руководством Шуйской епархии о передаче церковного имущества Русской Православной Церкви, которые проходили при посредничестве депутата Государственной Думы Алексея Хохлова. Итогом переговоров стал  подписанный 28 мая 2018 года договор между банком «Восточный» и Шуйской епархией.	 В рамках данного договора на первом этапе – летом 2018 года – банк передал два объекта недвижимости и два земельных участка.  В числе передаваемого имущества – основное здание Крестовоздвиженской церкви. Весной 2019 года банк «Восточный» передал епархии последнюю, оставшуюся часть комплекса, состоящую из земельного участка и здания, которое и представляло собой часть Георгиевской церкви.	 Банк «Восточный» считает, что передача комплекса храмовых построек Русской Православной Церкви станет началом восстановления древнего памятника русской религиозной культуры. 	 «Мы рады завершить передачу Русской Православной Церкви одного из старейших храмовых комплексов Ивановской области. Крестовоздвиженская церковь в Шуе не просто храм. В ней нашли отражение история и культура нашей страны. Но было бы неправильно видеть в этих постройках лишь памятник. Мы надеемся, что передача храма Русской Православной Церкви позволит вновь вдохнуть в него жизнь. Это важное дело и для верующих, и для всех, кого заботит судьба русской культуры», – отметил Александр Нестеренко, и.о. Председателя Правления банка «Восточный».	 Правящий архиерей Шуйской епархии, епископ Шуйский и Тейковский Матфей, заявил: «Благодаря бескорыстной помощи банка «Восточный» появилась надежда на восстановление древней святыни. Призываю Божие благословение на руководство и ответственных работников Банка, которые провели огромную работу по документальному оформлению теперь уже церковной собственности. Значительную помощь при этом оказала и Глава городского округа Шуя Наталья Корягина. Следует обязательно отметить, что небольшую долю недвижимости Храмового комплекса пришлось выкупать у частного предпринимателя. Денежные средства на это пожертвовали неравнодушные люди, причем некоторые из них отдали все свои личные сбережения, по примеру притчи из Евангелия о «лепте вдовицы». Нельзя не сказать также о больших трудах десятков наших добровольцев-волонтеров. Их усилиями вывезен весь мусор, убрана территория комплекса. Сейчас мы готовим обращения в адрес федеральных структур о возможном выделении целевого финансирования на подготовку соответствующей проектно-сметной документации и на восстановление этих исторических храмовых зданий. Надеемся, что банк «Восточный» продолжит свою действенную помощь и в этой работе, что явилось бы и для его руководства, и для сотрудников, поистине, Духовным Покровом и Божией помощью в их профессиональной деятельности».', '2019-04-15', 'false'),
	(90, 'Восточный банк', 'Банк «Восточный» объявляет о досрочном единовременном доначислении резервов в размере 11,8 млрд рублей в рамках плана финансовой устойчивости', 'Банк «Восточный» объявляет о досрочном единовременном доначислении резервов в размере 11,8 млрд руб., предусмотренных в рамках согласованного с Центральным Банком РФ плана финансовой устойчивости по результатам проверки, закончившейся в 2018 году.	 «Изначально план финансовой устойчивости (ПФУ) банка предполагал поэтапное начисление резервов до середины 2020 года. Банку удалось выполнить ПФУ досрочно за счет прибыльной бизнес-модели и эффективных действий по восстановлению капитала. На текущую дату неисполненных предписаний регулятора у банка «Восточный» не имеется», – отметил Александр Нестеренко, и.о. Председателя Правления банка «Восточный».	 Капитал банка по состоянию на апрель 2019 стабилен и составляет 28 млрд руб., что позволяет банку и дальше следовать выбранной бизнес-стратегии диверсификации рисков. 	 Сегодня банк «Восточный» продолжает соблюдать все нормативы достаточности капитала.	 Банк оценивает свое состояние как устойчивое: на начало апреля 2019 года запас мгновенной ликвидности составляет 50 млрд руб. Органическая прибыль по итогам 2019 года планируется на уровне 10 млрд руб.', '2019-04-18', 'false'),
	(88, 'Восточный банк', 'Клиенты, оформившие  новые кредитные карты банка «Восточный», смогут выиграть призы на сумму до 100 000 рублей', 'Банк «Восточный» предлагает своим клиентам принять участие в акции «Больше покупок – больше подарок». В рамках акции каждый клиент банка «Восточный», оформивший кредитную карту Visa в период проведения акции, сможет поучаствовать в розыгрыше сертификатов на покупку техники.	 Для того чтобы принять участие в акции, необходимо в период с 22 апреля до 31 мая 2019 года оформить кредитную карту Visa банка «Восточный» и использовать ее в качестве средства оплаты как минимум один раз.	 Участник акции, который оформил карту банка «Восточный» и оплатил ею любую покупку, получает возможность выиграть сертификат в магазины цифровой, бытовой техники и электроники номиналом 20 000 рублей. А совершив одну или более расходных операций по карте на сумму от 1 000 рублей, можно выиграть сертификат на покупку техники на сумму 100 000 или 50 000 рублей.	 Чем больше сумма и количество операций по кредитной карте – тем выше шанс получить приз.	 Победители розыгрыша будут определены в период с 1 по 15 июня. Каждый победитель может получить свой приз с 16 по 30 июня в отделениях банка «Восточный».	 Количество победителей и призов розыгрыша ограничено.	 Подробнее об акции и правилах ее проведения можно узнать на сайте:  http://vstbnk.ru/winv	 В акции могут принять участие клиенты, оформившие кредитную карту Visa банка «Восточный». Подробнее о картах можно узнать на сайте банка: https://www.vostbank.ru/client/credit-card/.', '2019-04-22', 'false'),
	(89, 'Восточный банк', 'Банк «Восточный» представляет новую кредитную карту «Восторг» для повседневных трат', 'Банк «Восточный» представляет новую кредитную карту «Восторг», которая станет удобным платежным инструментом при повседневных тратах, благодаря привлекательным условиям, среди которых льготный беспроцентный период до 90 дней, что позволит совершать покупки без переплаты.  Таким образом, в течение трех месяцев можно совершать любые покупки в кредит и при этом не платить банку проценты. По карте «Восторг» предусмотрен комфортный кредитный лимит от 10 тыс. до 300 тыс. рублей, что делает ее привлекательной как для молодежи, так и для пенсионеров. По карте не предусмотрена плата за выпуск и годовое  обслуживание.	 Кроме того, держателю карты «Восторг» будет предложена новая бонусная программа «КЭШБЭК», в рамках которой  он сам сможет выбрать, за что хочет получать повышенный кэшбэк до 10%. Бонусные категории объединены в тематические группы, каждая из которых соответствует тому или иному целевому клиентскому сегменту. При этом тематика категорий выбирается не раз и навсегда, ее можно менять по своему усмотрению каждый месяц.	 Программа включает в себя 5 бонусных категорий со следующими условиями начисления кэшбека:  «За рулем» – бонусное предложение для автолюбителей – самая популярная на сегодня категория:  кэшбэк 10% при покупках на АЗС, 3% при оплате такси, каршеринга, парковок и штрафов ГИБДД, а также стандартный 1% за все остальные покупки; «Отдых» –  подойдет театралам и всем, кто любит развлечения: 10% кэшбэка за билеты в театр, кино и 5% при оплате счетов в барах, кафе и ресторанах, а за все остальное – 1%; «Тепло» – для тех, кто предпочитает экономить на ЖКХ, покупках в аптеках и билетах на транспорт – за все расходы по этим категориям возвращается 5%, а за все остальные покупки – 1%; «Онлайн покупки» – подходит для ценителей цифровых продуктов и онлайн-шопинга: электронные книги, фильмы и музыка, подписки на онлайн-кинотеатры и пр. – за все это будет возвращаться 10%, а 5% – за покупки одежды и обуви в интернет-магазинах, за все остальное, как обычно, 1%; «Все включено» – универсальная «настройка» карты, которая подходит всем:  2% кэшбэка за все покупки, оплаченные картой, вне зависимости от категорий.	  «На данном этапе рынок двигается в сторону продуктов, предоставляющих клиентам максимальную гибкость. Мы сформировали предложение, в рамках которого клиент может выбрать бонусную программу в соответствии с собственным стилем жизни. При этом, каждая  бонусная программа в высшей степени конкурентоспособна. Кроме того, если вернуть сумму покупок по карте в период до 3 месяцев, то не нужно платить проценты», – оценил особенности карты «Восторг» Алексей Крейтор, заместитель Председателя Правления банка «Восточный».	 Подробнее о карте «Восторг» можно узнать на сайте банка «Восточный»: https://www.vostbank.ru/client/credit-card/kreditnaya-karta-vostorg/.  ', '2019-04-19', 'false'),
	(86, 'Восточный банк', 'Режим работы отделений в майские праздники', ' Уважаемые клиенты! Банк «Восточный» поздравляет вас с майскими праздниками! Желаем счастья, здоровья и благополучия вам и вашим близким! 	Информируем вас о графике работы отделений в предпраздничные и праздничные дни:  	Клиентские офисы, расположенные в торговых комплексах:  	В отделениях по работе с юридическими лицами и VIP-клиентами: 	 Обращаем ваше внимание, что с 23:00 8 мая до 10:00 9 мая (время московское) дистанционные сервисы Интернет-банк и Мобильный банк будут доступны только в информационном режиме в связи с проведением технических работ.	 Осуществите необходимые финансовые операции заблаговременно.	 Ваш банк «Восточный»', '2019-04-24', 'false'),
	(87, 'Восточный банк', 'Банк «Восточный» запустил программу персонального обслуживания клиентов «Персональная линия»', 'Банк «Восточный» предлагает клиентам доступ к персональному обслуживанию, которое ранее предоставлялось в пакете VIP-привилегий. Новый сервис  «Персональная линия» доступен клиентам банка «Восточный» за символическую плату в размере 150 рублей в месяц.	 В рамках «Персональной линии» клиентам банка «Восточный» будет предоставлен круглосуточный сервис по приоритетному обслуживанию сотрудниками Контактного центра банка. Обслуживание включает комплексный подход – это выделенная линия поддержки, помощь по всем имеющимся у клиента банковским услугам, а также возможность оформить любой продукт дистанционно.     	 Услугу персонального обслуживания можно получить при обращении в банк «Восточный» за получением банковского продукта (открытие текущего банковского счета, выдача кредита), либо при наличии уже используемых продуктов. При этом в течение первого месяца клиенты будут пользоваться сервисом бесплатно. Абонентская плата взимается, начиная со второго месяца: на следующий день после списания платежа по кредитам или минимального обязательного платежа по кредитной карте, или через месяц в дату подключения услуги – по дебетовым продуктам.	 «В нашем банке предусмотрено множество премиальных услуг для привилегированных клиентов, одно из них – персональное обслуживание, формат которого стал прообразом запускаемого сейчас сервиса. Мы решили распространить практику персонального обслуживания на другие категории потребителей наших продуктов, предложив услугу по символической, доступной цене. Теперь клиент, подключивший услугу «Персональная линия» и обратившийся в Контактный центр банка, получит комплексное банковское индивидуальное обслуживание в дистанционном формате», – отметил Владимир Кудряшов, вице-президент по розничному комиссионному бизнесу банка «Восточный».	 Тарифы пользования сервисом «Персональная линия» закреплены на сайте банка по ссылке: https://www.vostbank.ru/help/tariff/	 Комиссия за услугу не списывается в случаях, если клиент получил кредитную карту, но не воспользовался ей, либо в случае, если клиент полностью восстановил кредитный лимит, но не закрыл его. Также комиссия не списывается при отсутствии или недостаточности на счете клиента денежных средств. В этих случаях услуга переходит в состояние «Приостановлена» до момента, когда клиент воспользуется кредитным лимитом или на счет поступят денежные средства.	 Отключить услугу можно по заявлению в отделениях банка или по обращению в Контактный центр банка «Восточный».', '2019-04-23', 'false'),
	(85, 'Альфа-Банк', 'S&P повысило оценку кредитоспособности Альфа-Банка и подтвердило его рейтинги на уровне «BB+/В»', 'Международное рейтинговое агентство S&P Global Ratings повысило оценку собственной кредитоспособности Альфа-Банка до «bb+» с «bb», долгосрочный и краткосрочные кредитные рейтинги Альфа-Банка подтверждены на уровне «BB+/В». Долгосрочный кредитный рейтинг ABH Financial Ltd. повышен до «BB-» с «B+», краткосрочный кредитный рейтинг подтвержден на уровне «B». Прогнозы по рейтингам Альфа-Банка и ABH Financial Ltd. — «Стабильные».\nАгентство S&P отмечает, что Альфа-Банк демонстрирует устойчивость к сложным условиям ведения операционной деятельности, что подтверждается стабильно высокими показателями генерируемой выручки, а также более низкими расходами на формирование резервов на возможные потери по кредитам по сравнению с банковским сектором. В связи с этим агентство S&P повысило оценку характеристик собственной кредитоспособности Банка, что обусловило повышение рейтинга ABH Financial Ltd.\nПри этом Альфа-Банк по-прежнему поддерживает адекватные показатели капитализации и демонстрирует эффективную систему управления рисками, отсутствие директивного кредитования и быстрое обращение взыскания на залоговое имущество, говорится в обосновании S&P. Рейтинговое агентство ожидает, что эти факторы поддержат качество активов банка даже в периоды рыночного спада. В дополнение, Альфа-Банк обладает более стабильным доступом к финансовым рынкам в сравнении с сопоставимыми российскими организациями.\nКроме того, аналитики обращают внимание на значительный прогресс в снижении концентрации кредитного риска. S&P ожидает, что и в дальнейшем Группа будет успешно управлять рисками, связанными со стратегией активного развития розничного кредитования, благодаря знанию рынка и значительному уровню прибыли. \n«Повышение оценки собственной кредитоспособности Альфа-Банка и кредитного рейтинга холдинговой компании ABH Financial Ltd свидетельствует о высоком уровне нашей надежности и кредитоспособности, а также правильности выстроенной нами стратегии», — подчеркнул заместитель председателя правления, главный финансовый директор Альфа-Банка Алексей Чухлов.\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-24', 'false'),
	(83, 'УБРиР', 'Клиенты УБРиР смогут накопить больше на вкладе «Мобильный»', 'Уральский банк реконструкции и развития (УБРиР) повысил ставки для розничных клиентов по вкладу «Мобильный» на 0,25 п.п. Теперь максимальная доходность, которую могут получить вкладчики, составляет 6,7% годовых1. Вклад «Мобильный» — самый гибкий в управлении вклад в УБРиР: клиенты могут пополнять и снимать деньги без ограничений в любое время. При этом открыть его можно всего в несколько кликов в интернет-банке или мобильном приложении. А для тех, кто привык проводить финансовые операции, общаясь с менеджерами банка, это можно сделать непосредственно в офисе УБРиР. Срок вклада — 210 дней, минимальная сумма открытия в интернет-банке и мобильном приложении — 1 тысяча рублей. Проценты начисляются на сумму вклада каждые 30 дней по выбору клиента — на вкладной или карточный счет. «В конце прошлого года на рынке сформировался тренд на повышение ставок: абсолютно все игроки финансового рынка поднимали доходность своих депозитных продуктов вслед за ростом ключевой ставки, — отметил директор по маркетингу УБРиР Алексей Мерзляков. — Но уже сейчас ситуация достигла своего максимума, и мы прогнозируем, что в ближайшей перспективе начнется обратный цикл — ставки плавно будут снижаться. Поэтому я считаю, что сейчас у многих клиентов есть прекрасная возможность воспользоваться моментом и разместить свои сбережения на гибких условиях под весьма хороший процент».', '2019-04-12', 'false'),
	(84, 'Альфа-Банк', 'Сергей Шевченко назначен членом правления Альфа-Банка', 'Директор по управлению и развитию сети Альфа-Банка Сергей Шевченко назначен членом Правления банка. Кандидатура Шевченко прошла все необходимые согласования и была одобрена ЦБ РФ.\nК команде Альфа-Банка Сергей Шевченко присоединился в начале 2019 года. До прихода в Альфа-Банк занимал пост Президента-Председателя Правления, входил в состав Наблюдательного совета Бинбанка. С февраля 2018 года возглавлял Временную администрацию Бинбанка, ранее — в ноябре 2017 года руководил Временной администрацией банка «ФК Открытие». В мае 2017 года возглавил Службу текущего банковского надзора Банка России. В 2014-2017 гг. возглавлял Балтийский банк, входящий в группу Альфа-Банка. С августа по декабрь 2014 года руководил Временной администрацией Агентства по страхованию вкладов по управлению Балтийским Банком. В 2010-2013 гг. занимал должность заместителя председателя Московского банка Сбербанка России, с 2013-2014 — занимал должность советника председателя Московского банка Сбербанка России. В 2009 году работал в банке «Северная Казна» на должности заместителя Председателя Правления. В 2003-2009 гг. занимал должность старшего вице-президента Альфа-Банка. \nСергей Шевченко окончил МГИМО МИД СССР в 1982 году по специальности «международные экономические отношения»\n				\n					 Альфа-Банк основан в 1990 году. Альфа-Банк является универсальным банком, осуществляющим все основные виды банковских операций, представленных на рынке финансовых услуг, включая обслуживание частных и корпоративных клиентов, инвестиционный банковский бизнес, лизинг, факторинг и торговое финансирование.\nАльфа-Банк является крупнейшим частным финансовым институтом России по размеру совокупных активов, совокупному капиталу, кредитному и депозитному портфелям.\nПо итогам 2018 года согласно данным финансовой отчетности (МСФО) совокупные активы Банковской группы «Альфа-Банк», куда входят ABH Financial, АО «Альфа-Банк» и дочерние финансовые компании, составили 47,2 млрд. долларов США, совокупный кредитный портфель — 30,6 млрд. долларов США, совокупный капитал — 7,2 млрд долларов США. Чистая прибыль за 2018 год составила 1,3 млрд долларов США.\nПо состоянию на 31 декабря 2018 года в Альфа-Банке обслуживается более чем 530 тыс. корпоративных клиентов и 16,1 млн физических лиц. В Москве, регионах России и за рубежом открыто 752 отделений и филиалов, в том числе дочерний банк в Нидерландах и финансовые дочерние компании в Великобритании и на Кипре. \n				\n				\n			', '2019-04-24', 'false'),
	(81, 'УБРиР', 'Новые тарифы на услуги для юридических лиц по РКО', 'Уважаемые клиенты!С 16.04.2019г. внесены изменения в Тарифы для юридических лиц (некредитных организаций) и индивидуальных предпринимателей в валюте Российской Федерации.Ознакомиться с тарифами Вы можете в офисе банка или в разделе «Тарифы на РКО». ', '2019-04-16', 'false'),
	(82, 'УБРиР', 'Держатели карт «Мир» от УБРиР получили возможность побывать на отборочных матчах ЧЕ-2020', 'Екатеринбург, 15 апреля 2019 г. — Платежная система «Мир», официальный партнер сборной России по футболу, объявила о запуске тематической акции для держателей своих карт. К кампании подключился Уральский банк реконструкции и развития (УБРиР).Цель акции – дать болельщикам со всей России возможность поддержать национальную сборную во время отборочных матчей Чемпионата Европы-2020. Выиграть призы можно по 20 октября 2019 года включительно. Чтобы принять участие, необходимо совершать покупки по карте «Мир» на сумму не менее 300 рублей каждая и регистрировать чеки на промо-странице.Главный приз акции – поездка на один из отборочных матчей сборной России по футболу с посещением предматчевой тренировки. Ближайшие игры пройдут 8 июня в Саранске и 11 июня в Нижнем Новгороде. Болельщики также могут получить возможность посетить тренировку национальной сборной в Новогорске.В рамках кампании будет также разыграно 120 билетов на двоих на матчи сборной России. Платежная система «Мир» также подготовила специальные призы для любителей футбола: сертификаты в «Спортмастер», промокоды «Яндекс.Такси» и сувениры с автографами игроков сборной. Все участники акции гарантированно получат подарок за первый зарегистрированный чек.К моменту старта продаж билетов на матчи будут анонсированы дополнительные привилегии для держателей карт «Мир». Подробные условия акции можно узнать по ссылке.Платежная система «Мир» – российская национальная платежная система. Ее участниками являются 315 банков, практически все они уже осуществляют прием и обслуживание карт «Мир» в сети своих устройств. Более 160 банков занимаются выпуском карт «Мир». Выпущено уже более 55 млн карт. Карты принимаются за рубежом за счет ко-бейджинговых программ с международными платежными системами, выпускаются карты «Мир»-Maestro, «Мир»-UnionPay и «Мир»-JCB.Оператором платежной системы «Мир» является акционерное общество «Национальная система платежных карт» (НСПК). Задачи НСПК – обеспечение бесперебойности операций по картам международных платежных систем на территории России, построение и развитие российской системы платежных карт. Внутрироссийские операции по картам всех платежных систем, в том числе международных, осуществляются через процессинг операционного платежного и клирингового центра НСПК (ОПКЦ НСПК). ', '2019-04-15', 'false'),
	(80, 'УБРиР', 'УБРиР защитит своих клиентов от мошенничества с картами', 'Екатеринбург  16 апреля 2019 г. — Уральский банк реконструкции и развития (УБРиР) запустил новую услугу — страхование карт своих клиентов. Сервис появился в рамках комплексной программы по безопасности платежей, чтобы защитить клиентов от незаконных списаний средств.Условия страхования распространяются как на дебетовые, так и на кредитные карты. Заключив договор, клиент может быть уверен, что в случае кражи его "пластика" и последующего списания средств потерянная сумма будет возмещена. Также в страховые случаи попадают ситуации, при которых владелец карты стал жертвой скимминга или фишинга. Важным преимуществом нового предложения является страхование средств и при телефонном мошенничестве.«Весь банковский рынок фиксирует всплеск мошеннических действий. При этом мошенничества с картами становятся все более изощренными — новые схемы появляются почти каждый месяц. И если банки могут надежно защитить своих клиентов посредством специального оборудования, то наиболее уязвимыми остаются сами пользователи банковских карт, которые сообщают мошенникам свои персональные данные — PIN-код, CVV-код или короткий четырехзначный код, который приходит в SMS для подтверждения платежа. Финансовые потери в таких ситуациях могут достигать десятков, а иногда сотен тысяч рублей. Именно для защиты своих клиентов в таких случаях мы запустили услугу по страхованию рисков, связанных с картами», — прокомментировал директор по маркетингу УБРиР Алексей Мерзляков.Страховой платеж по программе УБРиР составляет 950 рублей в год, а сумма возмещения достигает 35 тысяч рублей. Воспользоваться предложением можно в любом офисе банка.', '2019-04-16', 'false'),
	(79, 'УБРиР', 'УБРиР запустил для бизнес-клиентов онлайн-тестирование сотрудников', 'Уральский банк реконструкции и развития (УБРиР) расширил перечень сервисов «HR-консалтинга» и запустил для бизнес-клиентов новую услугу «Онлайн-тесты для кандидатов и сотрудников». Теперь предприниматели при подборе персонала могут протестировать соискателей, чтобы не полагаться на субъективную оценку и полностью оценить потенциал и особенности характера кандидатов. Также это исследование можно использовать для уже работающих сотрудников. Тесты составляются по индивидуальным запросам компании и позволяют оценить как деловые, так и личностные качества кандидата. Пройти онлайн-тесты кандидаты и сотрудники могут со своего компьютера или мобильного устройства без какого-либо участия со стороны работодателя. После прохождения онлайн-тестов предприниматель получит полный отчет с рекомендациями для принятия финального решения. Стоимость услуги составляет 1100 рублей, при этом предприниматель одновременно может протестировать пять кандидатов и назначить неограниченное количество тестов на каждого. Услугу можно оформить в офисах банка, обслуживающих юридических лиц. Узнать подробности можно по телефону службы поддержки бизнеса 8 (800) 700-59-59. «Не редки случаи, когда при оценке кандидата на должность владелец или руководитель бизнеса фокусируется на отдельных качествах соискателя и упускает нюансы, которые в дальнейшем могут помешать ему влиться в коллектив и достигать результата. Причин этому много – от банальной нехватки времени до отсутствия специальных знаний, — рассказала директор по развитию корпоративного бизнеса УБРиР Елена Сорвина. — Поэтому для тех, кто не держит штатного кадровика, мы предлагаем воспользоваться услугой по поиску и тестированию персонала. Отличие нашего предложения от стандартных интернет-тестов – это индивидуальная разработка под задачи бизнеса и профиль должности. Сервис поможет существенно минимизировать затраты на подбор, обучение персонала и сократит текучку». Напомним, два года назад для бизнес-клиентов УБРиР был запущен сервис «HR-консалтинг» с разным набором услуг по поиску сотрудников. Только за прошлый год предприниматели приобрели в банке более 3 тысяч таких услуг. Самой популярной оказалась услуга по подбору резюме, ей воспользовалась половина клиентов, оформивших HR-консалтинг. По статистике, чаще всего предприниматели просят найти менеджера по продажам, бухгалтера, инженера и юриста. Единичные запросы приходили на поиск ветеринарного врача, менеджера по развитию парикмахерского бренда и плиточника.', '2019-04-18', 'false'),
	(78, 'УБРиР', 'УБРиР получил сразу три топовых награды международной премии за лучший клиентский опыт', 'Уральский банк реконструкции и развития (УБРиР) стал обладателем трех престижных наград CX WORLD AWARDS — международной премии в области клиентского опыта.Победу в номинации «Лучший клиентский опыт в В2С секторе / финансовые услуги» завоевал проект УБРиР «Система менеджмента качества»: в банке за короткий срок были разработаны и поэтапно внедряются единые стандарты обслуживания в различных каналах, клиентоориентированный подход становится основой при оптимизации внутренних процессов, создании продуктов.В номинации «Лучшая практика вовлеченности персонала» команда по УБРиР получила высокое одобрение жюри за проект «День клиента» — значимый источник сбора обратной связи как от внешнего, так и от внутреннего клиента.Кроме того, высокого одобрения жюри удостоена команда Центра развития сервиса в номинации «Лучшая команда клиентского опыта В2С». Центр развития сервиса УБРиР — это штаб, который отвечает за разработку и внедрение конкретных мероприятий по повышению качества обслуживания, опираясь на обратную связь от клиентов.Международная премия СХ WORLD AWARDS — одна из самых известных и престижных наград в индустрии Customer Experience. Вручается ежегодно на площадке CX WORLD FORUM. Авторитетное жюри, в состав которого входят ведущие эксперты из России и зарубежных стран, выявляет и награждает интересные и успешные проекты, инициативы и стратегии по развитию клиентского опыта.«Мы рады, что профессионализм и энтузиазм нашей команды высоко оценило экспертное сообщество. Конкуренцию в номинациях нам составили сильные игроки банковской отрасли, телекома, страхования, сферы обслуживания, многие из которых участвуют в премии не первый год, — прокомментировала директор по развитию сервиса УБРиР Майя Кантор. — Обратная связь от клиента стала основным драйвером улучшений процессов, продуктов и обслуживания в банке. Высокая оценка экспертного сообщества наших проектов подтверждает, что мы на правильном пути».', '2019-04-19', 'false'),
	(76, 'УБРиР', 'Новые тарифы на услуги для юридических лиц по РКО', 'Уважаемые клиенты!С 29.04.2019г. внесены изменения в Тарифы для юридических лиц (некредитных организаций) и индивидуальных предпринимателей в валюте Российской Федерации.Основные изменения можно посмотреть здесь.Ознакомиться с тарифами Вы можете в офисе банка или в разделе «Тарифы на РКО». ', '2019-04-22', 'false'),
	(77, 'УБРиР', 'УБРиР первым на Урале запустил рекламную кампанию с агентством SETTERS', 'Екатеринбург, Санкт-Петербург, 19 апреля 2019 года — Уральский банк реконструкции и развития (УБРиР) разработал и запустил рекламную кампанию с агентством SETTERS — одним из лидеров коммуникационного рынка России. Проект по продвижению кредитной карты «120 дней без процентов» стартовал 15 апреля в Instagram-аккаунте УБРиР.Авторы креативной концепции отказались от прямой демонстрации преимуществ кредитной карты и перестроили коммуникацию банка в Instagram с учетом смыслов и ценностей, разделяемых целевой аудиторией. Итогом работы стало создание территории на стыке маркетинга, психологии и фотоискусства — территории, привлекательной для клиента.«Перед нами стояла задача: показать клиенту его самого через тщательно продуманный визуальный и смысловой ряд. Примечательно, что сами клиенты помогли нам в этом, сообщив о своих увлечениях, потребительских предпочтениях и поведенческих характеристиках при выборе финансовых продуктов. Уверен, свежий контент понравится нашим подписчикам и привлечет дополнительное внимание, — рассказал директор по маркетингу УБРиР Алексей Мерзляков. — Мы довольны совместным проектом с SETTERS, ребята в очередной раз доказали, что они высококлассные профессионалы, единственные в своем роде».В свою очередь, арт-директор SETTERS Алина Чичина отметила: «Скажу честно, мы были приятно удивлены высокому уровню креатива и энтузиазма коллег, работающих в уральской столице. Далеко не каждая компания, тем более федерального масштаба, готова выходить за рамки устоявшихся приемов и шаблонов. Уверена, что результат нашей совместной работы найдет отклик у целевой аудитории продукта».Партнеры договорились о продолжении сотрудничества.Кредитная карта с льготным периодом до 120 дней, который распространяется на операции по оплате товаров или услуг и снятие наличных. Кредитный лимит устанавливается в размере от 30 тыс. до 299 999 рублей. Преимущества карты — длительный льготный период, наличие кешбэка 1% за любые покупки и возможность возврата платы за обслуживание.УБРиРАлексей Мерзляков — директор по маркетингу;Борис Шлейнов — head of SMM;Мария Левченко — SMM-менеджерSETTERSАксинья Дмитриева — продюсер;Илья Ровный — фотограф;Яна Жихарева, Мила Веселова — визажисты;Иван Волков — техник;Кирилл Брюховецкий, Наташа Кондратьева — стилисты по волосам;Нина Новикова — стилист;Алина Гончарова — ассистент стилиста;Ольга Коршунова — реквизитор;Тимур Сунцов — бэкстейдж;Роман Кукоба — ассистент по площадке;Модели:Анна КалининаИван ВолковРоман КасаткинАнна КубановаАндрей РадушинАнастасия ЧернобаеваКоммуникационное агентство SETTERS за три года существования вошло в ТОП-10 лучших в России по версии Tagline. Офисы агентства работают в Москве, Петербурге и Майами, команда насчитывает 120 человек. SETTERS работает с социальными сетями брендов, разрабатывает сайты, запускает эффективные рекламные кампании и масштабные спецпроекты с блогерами, о которых пишут главные издания страны.', '2019-04-19', 'false'),
	(74, 'УБРиР', 'В Карабаше откроется новый офис УБРиР', 'Карабаш, Челябинск, 22 апреля 2019 г. — Новый дополнительный офис «Карабашский» Уральского банка реконструкции и развития начнет свою работу 29 апреля по адресу: г. Карабаш, ул. Освобождения Урала, д. 27а. По словам руководителя дивизиона «Южный Урал» Галины Родиной, точка обслуживания теперь находится в шаговой доступности от градообразующего предприятия ЗАО «Карабашмедь».«Главным критерием успешной работы для нас было и остается удобство наших клиентов. Сотрудники градообразующего предприятия ЗАО «Карабашмедь» - наши основные клиенты и по их просьбе мы перенесли офис в шаговую доступность от места работы. Офис находится перед проходной предприятия, поэтому воспользоваться услугами нового офиса смогут все желающие, не только сотрудники завода. Таким образом,  УБРиР станет  еще ближе и доступнее для своих клиентов», — рассказала Галина Родина.Вместе с тем, 26 апреля прекратит работу отделение банка по старому адресу: ул. Комсомольская, д. 19а.УБРиР последовательно улучшает условия работы действующих отделений. Новое помещение офиса «Карабашский» соответствует современным требованиям ведения бизнеса и удобства клиента. Современный, комфортный офис ориентирован на работу с физическими лицами и предлагает весь спектр банковских услуг. В режиме одного окна клиенты смогут получить консультации по всем интересующим банковским продуктам, сделать вклад, взять кредит или оформить кредитную карту.Часы работы нового офиса УБРиР по адресу ул. Освобождения Урала, д. 27а:', '2019-04-24', 'false'),
	(75, 'УБРиР', 'Онлайн-тестирование кандидатов и сотрудников', 'Новая услуга для бизнес-клиентовНе уверены в компетенциях подобранных кандидатов или своих сотрудников? Хотите понять, как лучше управлять персоналом?Проведите комплексное онлайн-тестирование специалистов и узнайте ответы на эти вопросы!Благодаря сервису вы сможете проверить квалификацию нанимаемых сотрудников, минимизировать затраты на подбор и обучение персонала, а также снизить текучесть кадров.Услуга включает в себя тестирование 5 кандидатов за 1100 рублей. Тесты составляются по индивидуальному запросу, и позволяют оценить профессиональные и личностные качества специалистов. Такой подход поможет вам определить, соответствует ли специалист требованиям вашей компании. Количество тестов, назначенных каждому кандидату – не ограниченно. Требуется только определиться с тематикой тестирования и должностью, которую требуется.Все тесты кандидаты/сотрудники проходят со своего компьютера или мобильного устройства, без какого-либо участия со стороны работодателя. Они получают на e-mail ссылки для прохождения и просто кликают на них для входа.Уже на следующий день вы получите результаты в виде подробного отчета по каждому специалисту. Отчет настолько простой, что будет понятен даже тому, кто никогда не занимался подбором персонала.Чтобы воспользоваться услугой обращайтесь в офис банка по обслуживанию юридических лиц.', '2019-04-24', 'false'),
	(94, 'Восточный банк', 'Новые весенние категории для получения повышенного кэшбэка по «Карте №1» банка «Восточный» оценят все, кто заботится о своем здоровье и красоте, и те, кто любит путешествовать   ', 'Банк «Восточный» предлагает своим клиентам – держателям дебетовой «Карты №1» – воспользоваться самыми актуальными этой весной категориями для получения повышенного кэшбэка до 5%.     	 Новый «комплект» категорий для повышенного кэшбэка оценят все, кто заботится о своем здоровье и красоте, и те, кто любит путешествовать. Так, держатели «Карты №1» банка «Восточный» смогут вернуть до 5% от суммы чека в категориях:  «Красота» (спортивные и фитнес-клубы, парикмахерские, салоны красоты и массажные салоны и пр.), «Железнодорожные билеты», «Туристические агентства» (включая booking.com, airbnb.com и т.п.).  При этом стандартный кэшбэк в размере 1% сохраняется на любые другие покупки.	 Новые категории для получения повышенного кэшбэка выбраны неслучайно. Впереди самый любимый сезон россиян – сезон отпусков, выгодно подготовиться к которому поможет «Карта №1» банка «Восточный». Теперь благодаря повышенному кэшбэку клиенты «Восточного»  смогут не только встретить лето красивыми и стройными, но и сэкономить при планировании отпуска. 	 Напоминаем, что схема начисления кэшбэк максимально удобна, потому что теперь клиент может сам управлять процессом выплаты, а именно: выбрать дату выплаты и количество бонусов, которые ему нужно конвертировать в рубли и потратить. Конвертация происходит не один раз в месяц, а столько раз, сколько нужно клиенту. Операция совершается клиентом в его личном кабинете в мобильном или интернет-банках. Бонусы начисляются не позднее чем через 5 дней после совершения операции по карте. В режиме реального времени накопленными бонусами можно в любой момент компенсировать совершенные ранее покупки по карте (конвертация по курсу 1 бонус = 1 рубль). Итог компенсации – зачисление  рублей на карточный счет.	 Отметим, что сегодня бонусная программа от банка «Восточный» одна из самых понятных и выгодных на рынке карточных продуктов, так, участие в сезонной акции по получению повышенного кэшбэка не потребует специальной регистрации. Средства кэшбэка после конвертации можно тратить на любые цели без ограничений: оплачивая покупки в торговых точках, включая интернет-магазины, совершая переводы с карты на карты (себе и своим близким и друзьям), оплачивая коммунальные услуги и многое другое.	 Обновленная программа получения бонусов продлится до 30 июня 2019 года, а те клиенты, у которых еще нет карты банка «Восточный», могут оформить ее в самые быстрые сроки, заполнив анкету на сайте: https://www.vostbank.ru/client/debit-card/n1/, и сразу же после получения можно начинать собирать повышенный кэшбек. ', '2019-04-05', 'false'),
	(95, 'Восточный банк', 'Проведение технических работ в Мобильном и Интернет-банке', ' Уважаемые клиенты! В связи с проведением технических работ 7 апреля с 00:00 до 00:30  и с 23:00 до 23:59, а также 8 апреля с 00:00 до 01:00  (время московское) могут быть недоступны операции по картам Банка, в том числе в Интернет- и Мобильном банке. Приносим извинения за возможные неудобства.', '2019-04-04', 'false');
INSERT INTO `kreditproducts` (`id`, `name`, `idcat_cpa`, `shortcpa`, `idoffer_cpa`, `description`, `shortdescription`, `typeproduct`, `banner`, `sumstart`, `sumend`, `freeperiod`, `typefreeperiod`, `status`, `srokstart`, `typesrokstart`, `srokend`, `typesrokend`, `timeforconsideration`, `typetimeforconsideration`, `internetbank`, `agestart`, `ageend`, `percentstart`, `typepercentstart`, `percentend`, `typepercentend`, `cpa`, `urloffer`, `profit`, `typeprofit`, `phonenumber`, `site`, `dateupdateInfo`, `cr`, `ar`, `epc`, `logoleds`, `organization`) VALUES
	(28, 'Альфа банк -  «100 дней без %»', 4, NULL, 834, '<p>Альфа-Банк является бесспорным лидером среди частных банков на территории России. Деятельность его началась с 1990 года и на текущий момент база частных клиентов насчитывает более 16 миллионов. За время существования банка он неоднократно оценивался как Российскими так и иностранными рейтинговыми агентствами.</p><p>Альфа-Банк имеет большой выбор финансовых услуг, где каждый может подобрать по своим требованиям нужный продукт. Одним из таких продуктов является кредитная карта Альфа-Банк "100 дней без процентов", являясь специальным продуктом банка она имеет отличительные характеристики от других кредитных карт: большой льготный период без начисления процентов, который составляет 100 дней. Благодаря выгодным условиям данную карту можно использовать для закрытия кредитов, это позволит сэкономить деньги.Карта "100 дней без процентов" оформляться на сайте банка и доставляется в нужное&nbsp;место и в удобное время. </p><p>Карта поддерживает технологию бесконтактных платежей, что позволит совершать покупки удобнее, а удобный мобильный банк дает полный контроль над состоянием счета.</p>', 'Кредитная карта Альфа-Банк "100 дней без процентов"', 'Кредитные карты', 'alfabank.webp', 30000, 500000, 100, 'дней', 'true', 1, 'месяц', 60, 'месяцев', 10, 'минут', 'true', 21, 75, 14.99, 'в год', 33.34, 'в год', 'Leads', 'https://pxl.leads.su/click/bb18e68febac881465db36d5e6180b3d', '3200', 'cpa_fix', '+7 495 78-888-78', 'https://alfabank.ru', '2019-04-22 11:36:00', 26.47, 6.77, 57.22, NULL, 'Альфа-Банк'),
	(29, 'Альфа банк "Перекресток" ', 4, NULL, 910, '<p>Альфа-Банк&nbsp;является&nbsp;одним&nbsp;из&nbsp;крупнейших&nbsp;банков&nbsp;в&nbsp;России,&nbsp;количество&nbsp;клиентов,&nbsp;доверяющих&nbsp;банку&nbsp;уже&nbsp;более&nbsp;16&nbsp;миллионов,&nbsp;и&nbsp;с&nbsp;каждым&nbsp;днем&nbsp;их&nbsp;число&nbsp;растет.&nbsp;Гибкие&nbsp;тарифные&nbsp;планы&nbsp;позволят&nbsp;выбрать&nbsp;нужный&nbsp;финансовый&nbsp;продукт.Высокое&nbsp;качество&nbsp;обслуживания&nbsp;неоднократно&nbsp;оценивалось&nbsp;как&nbsp;иностранными,&nbsp;так&nbsp;и&nbsp;Российскими&nbsp;агентствами,&nbsp;что&nbsp;доказывают&nbsp;многочисленные&nbsp;награды.</p><p>Кредитная&nbsp;карта&nbsp;"Перекресток"&nbsp;отлично&nbsp;подойдет&nbsp;для&nbsp;ежедневного&nbsp;использования,&nbsp;при&nbsp;совершении&nbsp;покупок&nbsp;начисляются&nbsp;баллы,&nbsp;которые&nbsp;можно&nbsp;потратить&nbsp;на&nbsp;покупки&nbsp;в&nbsp;магазинах-партнерах,&nbsp;так&nbsp;же&nbsp;обладатели&nbsp;карты&nbsp;могут&nbsp;получать&nbsp;скидки&nbsp;и&nbsp;уведомления&nbsp;об&nbsp;акциях&nbsp;в&nbsp;у&nbsp;&nbsp;партнеров.Мобильное&nbsp;приложение&nbsp;"Альфа-Мобайл"&nbsp;позволит&nbsp;контролировать&nbsp;состояние&nbsp;счета&nbsp;всегда&nbsp;знать&nbsp;необходимую&nbsp;сумму&nbsp;для&nbsp;платежа.&nbsp;</p><p>Помимо&nbsp;оплаты&nbsp;покупок&nbsp;кредитная&nbsp;карта&nbsp;Альфа-Банк&nbsp;позволяет&nbsp;снимать&nbsp;деньги&nbsp;в&nbsp;банкоматах,&nbsp;а&nbsp;так&nbsp;же&nbsp;совершать&nbsp;переводы&nbsp;без&nbsp;процентов&nbsp;на&nbsp;другие&nbsp;карты.</p>', 'Кредитная карта Альфа-Банк "Перекресток"', 'Кредитные карты', 'perekrestok.webp', -1, -1, -1, '', 'true', -1, '', -1, '', -1, '', 'true', -1, -1, -1, '', -1, '', 'Leads', 'https://pxl.leads.su/click/be8f7b99f462361bdfb5a8639a40b6bc', '3200', 'cpa_fix', '', 'https://alfabank.ru', '2019-04-22 11:36:00', 15.39, 1.3, 6.96, NULL, 'Альфа-Банк'),
	(30, '"Совесть"', 4, NULL, 959, NULL, NULL, 'Кредитные карты', NULL, -1, -1, -1, '', 'false', -1, '', -1, '', -1, '', 'true', -1, -1, -1, '', -1, '', 'Leads', 'https://pxl.leads.su/click/a6bf5cfd8ffdfd83e83d158b59987153', '2500', 'cpa_fix', '', '', '2019-04-22 11:37:00', 30.2, 1.41, 10.69, NULL, 'QIWI Банк'),
	(31, 'УБРиР', 4, NULL, 1023, '<p>"Уральский банк реконструкции и развития" основан в сентябре 1990 года в городе Екатеринбург. История банка интересная, стоит выделить, что <strong>УБРиР </strong>    всегда стремился быть первым, поэтому в банке всегда внедрялись инновации, вызывающие крупных организаций\n    доверие. Благодаря постоянному стремлению стать лучше предоставляет широкий спектр услуг, одной из которых является кредитование физических лиц, с выгодной процентной ставкой и большим выбором тарифов. Оформить кредит в <strong>УБРиР</strong> можно на сайте компании,\n    и получить решение по заявке не выходя из дома или офиса, сэкономив при время на посещении отделения банка.\n</p>\n<p>Качество обслуживания в <strong>УБРиР</strong> всегда показывает высокий уровень квалификации персонала, а из-за грамотного подхода к развитию он занимал неоднократно награды и входит в ТОП-100 лучших банков по мнению Forbes.\n</p>\n<p>В настоящее время границы работы банка расширяются, уже открыто более 200 офисов по всей стране и их количество растет. Большое удобство для клиентов имеет наличие приложений под смартфоны и наличие интернет-банка. Для удобства клиентов создана служба\n    поддержки, работающая 24/7.</p>', 'Кредит в банке УБРиР', 'Кредитные карты', 'ubrir.webp', 30000, 299999, 120, 'дней', 'true', 1, 'месяца', 36, 'месяцев', 30, 'минут', 'true', 19, 75, 28, 'в месяц', 31, 'в месяц', 'Leads', 'https://pxl.leads.su/click/580ea6983856235448f6c9b99e9cfa90', '4500', 'cpa_fix', '8 (800) 1000-200', 'https://ubrr.ru', '2019-04-22 09:25:00', 24.45, 1.07, 12.03, NULL, 'УБРиР'),
	(32, 'Тинькофф. Кредитные системы ', 4, NULL, 60, '<p>Тинькофф банк работает с 2006 года на Российском рынке финансовых услуг, основан Олегом Тиньковым. </p><p>Основное отличие банка от других - это отсутствие отделений и полная работа онлайн.На протяжении всех лет работы банка он каждый год получает огромное количество наград, показывающие высокий уровень качества обслуживания. С каждым годом он вводит новые сервисы, которые без сомнения будут полезны для клиентов.</p><p>Начиная с 2011 года существует мобильное приложение, который позволяет управлять и контролировать финансы. Кредитная карта Тинькофф дает возможность получения денег быстро и без сложностей. Кредитка очень популярна среди и пользователей уже более 8000000. Для снятия средств можно использовать любой банкомат, без комиссии.</p><p>Контроль за состояние счета осуществляется через личный кабинет, который детально показывает расходы, остаток лимита и сумму ежемесячного платежа.</p>', 'Кредитная карта Тинькофф', 'Кредитные карты', 'tinkoff.webp', 5000, 300000, 55, 'дней', 'true', 1, 'месяца', 36, 'месяцев', 1, 'день', 'true', 18, 75, 12, 'в год', 49.9, 'в год', 'Leads', 'https://pxl.leads.su/click/f1da291f65ce3515af25489397026fff', '1500', 'cpa_fix', '8 800 555-77-78', 'https://www.tinkoff.ru', '2019-03-18 15:54:00', 21.57, 10.27, 32.75, NULL, 'Тинькофф'),
	(33, 'Восточный Банк', 4, NULL, 1018, 'Банк Восточный основан в 1991 году в Амурской области и на текущий момент является банком федерального значения. КБ Восточный входит в список самых больших частных банков на территории России и по версии Forbes входит в ТОП-100 самый надежных банков. Основной упор работы основан на качестве предоставляемых финансовых услуг. Кредитные карты Восточный имеют несколько видов и подойдет любому клиенту и каждый может выбрать необходимый продукт по своим требованиям: карта рассрочки, карта для получения кэшбэк(возврат процента от стоимости продукта), а так же несколько других видов карт.Данные о состоянии счета кредитной карты  Восточный и статистику затрат можно просматривать в личном кабинете.Подобрав необходимую карту можно расширить свои возможности и быть уверенным в отсутствии скрытых процентов и услуг. При оформлении карты Восточный банк она доставляется в ближайшее отделение в кратчайшие сроки.', 'Кредитная карта Банка Восточный', 'Кредитные карты', 'vostochnybank.webp', 55000, 400000, 56, 'дней', 'true', 1, 'месяц', 60, 'месяцев', 1, 'день', 'true', 21, 71, 10, 'в год', 29.9, 'в год', 'Leads', 'https://pxl.leads.su/click/cb3d387230efbdbe2a92d9d481c32801', '1600', 'cpa_fix', '8 800 100 7 100', 'https://www.vostbank.ru', '2019-04-22 11:36:00', 22.26, 2.98, 11.54, NULL, 'Восточный банк'),
	(34, 'Совкомбанк карта рассрочки Халва  ', 4, NULL, 1019, 'Совкомбанк основан в 1990 году в Костроме и на данный момент насчитывает более 2000 офисов по всей стране. Совкомбанк предоставляет возможность совершать покупки в рассрочку благодаря карте "Халва". &nbsp;Теперь совершать покупки можно без сбора документов и не оформляя кредит. Карта "Халва" помимо покупок позволяет получать возврат части потраченных денег на покупку у партнеров Совкомбанк. Одним из достоинств можно считать возобновляемый кредит на всю сумму. Карта "Халва" имеет возможность бесконтактных платежей и не имеет стоимости ежегодного обслуживания и бесплатной стоимости. Теперь покупать товары можно удобно и быстро имея с собой карту "Халва".Рост числа партнеров банка позволяет совершать покупки по выгодным условиям в больших количествах магазинов.Совкомбанк побеспокоился о маленькой процентной ставке и возможности использовать карту для вкладов с начислением процентов.', 'Кредитная карта Совкомбанк "Халва"', 'Кредитные карты', 'halva.webp', -1, 350000, -1, '', 'false', 1, 'месяц', 18, 'месяцев', 1, 'день', 'true', 20, 75, 6, 'в год', 7.5, 'в месяц', 'Leads', '', '1600', 'cpa_fix', '8-800-100-777-2', 'https://halvacard.ru/', '2019-04-22 11:35:00', 0, 0, 0, NULL, 'Совкомбанк'),
	(35, 'Быстрокарта  ', 4, NULL, 1131, '<p>Быстроденьги&nbsp;-&nbsp;микрофинансовая&nbsp;организация&nbsp;выдающая&nbsp;краткосрочные&nbsp;займы&nbsp;населению.&nbsp;Работая&nbsp;на&nbsp;финансовом&nbsp;рынке&nbsp;с&nbsp;2011&nbsp;года&nbsp;и&nbsp;получила&nbsp;большую&nbsp;популярность,&nbsp;а&nbsp;качество&nbsp;работы&nbsp;неоднократно&nbsp;было&nbsp;оценено&nbsp;разнообразными&nbsp;наградами.&nbsp;</p><p>Быстрокарта&nbsp;-&nbsp;это&nbsp;карта&nbsp;выдаваемая&nbsp;организацией&nbsp;и&nbsp;пополняемая&nbsp;моментально,&nbsp;для&nbsp;получения&nbsp;карты&nbsp;нужно&nbsp;оставить&nbsp;заявку&nbsp;на&nbsp;сайте&nbsp;компании&nbsp;и&nbsp;забрать&nbsp;карту&nbsp;в&nbsp;ближайшем&nbsp;отделении&nbsp;или&nbsp;заказать&nbsp;доставку&nbsp;курьером.&nbsp;Для&nbsp;пополнения&nbsp;карты&nbsp;необходимо&nbsp;позвонить&nbsp;по&nbsp;телефону&nbsp;горячей&nbsp;линии,&nbsp;деньги&nbsp;поступят&nbsp;на&nbsp;карту&nbsp;незамедлительно.Быстрокарта&nbsp;пригодится&nbsp;в&nbsp;тех&nbsp;случаях,&nbsp;когда&nbsp;есть&nbsp;необходимость&nbsp;в&nbsp;деньгах,&nbsp;а&nbsp;до&nbsp;зарплаты&nbsp;несколько&nbsp;дней.&nbsp;Контроль&nbsp;расходов&nbsp;и&nbsp;размер&nbsp;платежа&nbsp;производится&nbsp;в&nbsp;удобном&nbsp;личном&nbsp;кабинете.</p><p>В&nbsp;данный&nbsp;момент&nbsp;уже&nbsp;выдано&nbsp;более&nbsp;1000000&nbsp;карта,&nbsp;и&nbsp;количество&nbsp;их&nbsp;постоянно&nbsp;растет.&nbsp;Быстрокарта&nbsp;станет&nbsp;"карточкой-выручалочкой"&nbsp;в&nbsp;самое&nbsp;нужное&nbsp;время.&nbsp;Помимо&nbsp;снятия&nbsp;наличных&nbsp;можно&nbsp;расплачиваться&nbsp;в&nbsp;терминалах&nbsp;оплаты&nbsp;и&nbsp;в&nbsp;интернет-магазинах.</p>', 'Быстрокарта от Быстроденьги', 'Кредитные карты', 'bistrokarta.webp', 1000, 30000, -1, '', 'true', 1, 'дня', 30, 'дней', 1, 'минута', 'true', 18, 75, -1, '', 1.5, 'в день', 'Leads', 'https://pxl.leads.su/click/fa295665d72f359a7feea6d0b7972843', '700', 'cpa_fix', '8 800 700-43-44', 'https://bistrodengi.ru', '2019-04-22 11:36:00', 10.62, 0, 0, NULL, 'Быстроденьги');
